(27, 0, 84, 1, 'legal_scrub', 'legal_scrub', '<p>Banking with PNC<br />\r\nProcessing with FD MID: 517939030125967<br />\r\nPer the Website, the merchant doesn&rsquo;t take insurance<br />\r\n<br />\r\n● Quick Fix<br />\r\n● Advance Merchant Solutions<br />\r\n● Knight Capital<br />\r\n● EBF Partners</p>\r\n\r\n<p>● Arca Funding<br />\r\n● Midtown Funding<br />\r\n●</p>\r\n\r\n<p>Receivables:<br />\r\n● Single Firstech Medical Mutual</p>\r\n\r\n<p>UCCs to Amex, ADP, PayPal, and Single Firstech Medical Mutual<br />\r\nInformation Subpoena to FD MID: 517939030125967<br />\r\nBank runs to US Bank, Huntington Bank, PNC, Fifth Third Bank, Chase, Union Bank, KeyBank,<br />\r\nInvestors Bank, Apple Bank</p>\r\n\r\n<p><br />\r\n12/12/18. DR: Mr. Gibbons:<br />\r\nMy name is Doug Robinson, I am the attorney for Roc Funding, the merchant cash advance<br />\r\nthe company which provided you with a cash advance which you are currently in default on.<br />\r\nI&#39;m reaching out to you to see if you want to try and get this cash advance back on track. I have<br />\r\nwide authority to alter your payment plan, if necessary, or change the payment frequency.<br />\r\nNoting the size of the open balance, if we don&#39;t reach a resolution, I will be sending this case to<br />\r\nour OH collection law firm for immediate domestication of the judgment and at that time a fairly<br />\r\nsignificant legal fee attaches.<br />\r\nPlease take this opportunity to see if we can get you into a workable payment plan before this<br />\r\ngoes any further.<br />\r\nMy contact information is below.<br />\r\nThank you, Douglas Robinson</p>\r\n\r\n<p>Douglas E. Robinson, Esq.<br />\r\nRoc Funding<br />\r\n122 East 42nd Street, Suite 2112<br />\r\nNew York, NY 10168<br />\r\nP. (718) 775-3673<br />\r\nF. (888) 259-5884</p>\r\n\r\n<p>12/13/2018 Roc v. Chagrin Valley and Dennis Gibbons</p>\r\n\r\n<p>This gentleman is claiming this has been paid off.<br />\r\nPlease investigate.<br />\r\nThanks<br />\r\n12/28/2018 Per PayPal<br />\r\nPayPal accounts<br />\r\nDennis Gibbons<br />\r\ndennislmt@sbcglobal.net<br />\r\n$0<br />\r\nThere are currently no funds in the account(s). A temporary limitation has been placed on the<br />\r\naccount(s) that will allow funds to be received, but not withdrawn and the account holder has<br />\r\nbeen notified to contact your office with questions regarding the restraint.<br />\r\nUCC to Square<br />\r\n1/9/2019 Per Square- No Accounts<br />\r\nFirstPro- &nbsp;Mr. Robinson,<br />\r\n&nbsp;<br />\r\nFirsTech, Inc. received the attached documents via postal mail.<br />\r\n&nbsp;<br />\r\nFirsTech, Inc. does not have any relationships/agreements in place with Chagrin Valley Wellness Inc.<br />\r\nDBA Chagrin Valley Wellness Center and Dennis J. Gibbons.&nbsp;&nbsp;We believe this was sent to FirsTech, Inc. in<br />\r\nerror. Please advise.<br />\r\n&nbsp;<br />\r\nRegards,<br />\r\n&nbsp;<br />\r\nLARRY COLEMAN<br />\r\nSenior Operations Manager<br />\r\n1 N. Brentwood Blvd, Ste 910<br />\r\nSt. Louis, MO 63105<br />\r\nO: 314.558.8106<br />\r\nC: 314.421.9267<br />\r\nlcoleman@firstechinc.com<br />\r\n1/14/2019 ADP<br />\r\nNo Accounts<br />\r\nPer Amex- Processing with FD<br />\r\nJess please send UCC to FD</p>\r\n\r\n<p>ACCOUNT WITH OUTSIDE COUNSEL</p>\r\n\r\n<p><strong>On payment plan&nbsp;</strong></p>', 0, NULL, '2020-01-21 18:53:55', '2020-01-21 18:53:55', NULL),
