(34, 0, 89, 1, 'legal_scrub', 'legal_scrub', '<p>We have a judgment for $54,453.55<br />\r\nBanking with WF- Accounts are negative with no pending deposits<br />\r\nJess please send Bank runs to WF, BOA, PNC, Citizens Bank, TD, Santander, Citizens Bank,<br />\r\nCrown Bank, BB&amp;T, Provident Bank, Woodforest, Sterling Bank, US Bank, Capital One,<br />\r\nHSBC, and Huntington Bank</p>\r\n\r\n<p><br />\r\nLiz please send UCCs to Amex, PayPal and Square</p>\r\n\r\n<p>12/12/18: Mr. Martinez:<br />\r\nMy name is Doug Robinson, I am the attorney for Roc Funding, the merchant cash advance<br />\r\ncompany which provided you with a cash advance which you are currently in default on.<br />\r\nI&#39;m reaching out to you to see if you want to try and get this cash advance back on track. I have<br />\r\nwide authority to alter your payment plan, if necessary, or change the payment frequency.<br />\r\nNoting the size of the open balance, if we don&amp;#39;t reach a resolution, I will be sending this case to<br />\r\nour NJ collection law firm for immediate domestication of the judgment and at that time a fairly<br />\r\nsignificant legal fee attaches.<br />\r\nPlease take this opportunity to see if we can get you into a workable payment plan before this<br />\r\ngoes any further.<br />\r\nMy contact information is below.<br />\r\nThank you, Douglas Robinson<br />\r\nDouglas E. Robinson, Esq.<br />\r\nRoc Funding<br />\r\n122 East 42nd Street, Suite 2112<br />\r\nNew York, NY 10168<br />\r\nP. (718) 775-3673<br />\r\nF. (888) 259-5884<br />\r\nPer PayPal<br />\r\nThank you for contacting PayPal, Inc.&nbsp;We are in receipt of your UCC Lien Notice<br />\r\nwith regard to JOGAN CONSTRUCTION. We have limited access to the following PayPal<br />\r\naccount(s) pursuant to the above-referenced UCC Lien Notice:<br />\r\nPayPal accounts<br />\r\nLarry Martinez<br />\r\nJoganconstruction@gmail.com<br />\r\nLarry Martinez<br />\r\nlarryymartinez@yahoo.com<br />\r\nAuto City Repair<br />