(36, 0, 126, 1, 'legal_scrub', 'legal_scrub', '<p>Banking with PNC<br />\r\nProcessing with Global Payments MID: 8788014187291<br />\r\nOther Cash Advances:<br />\r\n● Rapid Capital<br />\r\nJess please send Bank runs to PNC, Citizens, Chase, KeyBank, US Bank, Huntington Bank, Fifth Third<br />\r\nBank, BOA, and WF<br />\r\nLiz please send UCCs to Global Payments MID: 8788014187291, Amex and PayPal</p>\r\n\r\n<p>12/17/18. DR: My name is Doug Robinson, I am the attorney for Roc Funding, the merchant<br />\r\ncash advance company which provided you with a cash advance which you are currently in<br />\r\ndefault on.</p>\r\n\r\n<p>I&#39;m reaching out to you to see if you want to try and get this cash advance back on track. I have<br />\r\nwide authority to alter your payment plan, if necessary, or change the payment frequency.</p>\r\n\r\n<p>Noting the size of the open balance, if we don&#39;t reach a resolution, I will be sending this case to<br />\r\nour OH collection law firm for immediate domestication of the judgment and at that time a fairly<br />\r\nsignificant legal fee attaches.</p>\r\n\r\n<p>Please take this opportunity to see if we can get you into a workable payment plan before this<br />\r\ngoes any further.</p>\r\n\r\n<p>My contact information is below.</p>\r\n\r\n<p>Thank you, Douglas Robinson</p>\r\n\r\n<p>1/3/2019 KeyBank- No Accounts</p>\r\n\r\n<p>Woodforet- No Accounts<br />\r\n1/7/2019 5TH 3RD- No Accounts<br />\r\n1/11/2019 Huntington- No Accounts<br />\r\nCitizens Bank- No Accounts<br />\r\nUS Bank- No Accounts<br />\r\nPNC- No Accounts<br />\r\n2/11/2019 Per FD<br />\r\nRE: Information Subpoena with Restraining Notice<br />\r\nIssued To: First Data<br />\r\nFDC Reference No.: 8871436<br />\r\nIndex/Docket No.: 121423/2018<br />\r\nROC Funding Group LLC v Auto City Repair / Larry Martinez</p>\r\n\r\n<p>First Data Corporation hereby acknowledges service and receipt of the above referenced Judgment.<br />\r\nAccording<br />\r\nto our research conducted on the information you provided, this merchant&#39;s account(s) with First Data<br />\r\nhas been<br />\r\ncanceled, closed or is otherwise no longer processing.</p>\r\n\r\n<p>As a result, we will be unable to collect any funds in response to the Judgment issued. Therefore, First<br />\r\nData has<br />\r\nfulfilled its obligation for the Judgment issued and we will close the file in this matter.<br />\r\nSincerely,<br />\r\nACCOUNT WITH OUTSIDE COUNSEL<br />\r\n12/19/2019 Gold Coast Bank No accounts</p>\r\n\r\n<p><strong>BK Discharged- case closed</strong></p>', 0, NULL, '2020-01-21 19:26:06', '2020-01-21 19:26:06', NULL),
(37, 0, 91, 1, 'legal_scrub', 'legal_scrub', '<p>Banking with Regions Bank<br />\r\nOther Cash Advances:<br />\r\n● CFG Merchant Solutions<br />\r\n● Cash Factors<br />\r\n● Summar Financial Trade- Factoring Company<br />\r\n● Expansion Capital<br />\r\n● Pearl Capital</p>\r\n\r\n<p>Liz please send UCCs to Amex, Bel Cargo Corp Lds Transp Lds Transport, Smartpay Lds Transport, Square<br />\r\nand Paypal<br />\r\nJess please send Bank runs to Merrick Bank, WF, Chase, BOA, TD Bank, Citibank, Regions Bank, Fifth<br />\r\nThird Bank, BankUnited, BB&amp;T, US Bank, PNC, Huntington Bank, TD Bank, HSBC, BBVA, Ameris Bank,<br />\r\nCitizens and Synovous Bank</p>\r\n\r\n<p>12/12/18: DR: Ms. Santiago:</p>\r\n\r\n<p>My name is Doug Robinson, I am the attorney for Roc Funding, the merchant cash advance<br />\r\ncompany which provided you with a cash advance which you are currently in default on.</p>\r\n\r\n<p>I&#39;m reaching out to you to see if you want to try and get this cash advance back on track. I have<br />\r\nwide authority to alter your payment plan, if necessary, or change the payment frequency.</p>\r\n\r\n<p>Noting the size of the open balance, if we don&#39;t reach a resolution, I will be sending this case to<br />\r\nour FL collection law firm for immediate domestication of the judgment and at that time a fairly<br />\r\nsignificant legal fee attaches.</p>\r\n\r\n<p>Please take this opportunity to see if we can get you into a workable payment plan before this<br />\r\ngoes any further.</p>\r\n\r\n<p>My contact information is below.</p>\r\n\r\n<p>Thank you, Douglas Robinson</p>\r\n\r\n<p>Douglas E. Robinson, Esq.<br />\r\nRoc Funding<br />\r\n122 East 42nd Street, Suite 2112<br />\r\nNew York, NY 10168<br />\r\nP. (718) 775-3673<br />\r\nF. (888) 259-5884</p>\r\n\r\n<p>12/17/2018 Per PayPal<br />\r\nThank you for contacting PayPal, Inc. (&quot;PayPal&quot;). We are in receipt of your UCC Lien Notice with<br />\r\nregard to LDS TRANSPORT LLC. We have located the following PayPal account(s) that are<br />\r\nsubject to the above-referenced UCC Lien Notice:<br />\r\nPayPal accounts<br />\r\nNellie Santiago<br />\r\nldstransport@outlook.com<br />\r\n$0<br />\r\nNellie Vega<br />\r\nnellievega@msn.com<br />\r\n$0<br />\r\nNellie Santiago<br />\r\nnelliesantiago@icloud.com<br />\r\n$0<br />\r\nThere are currently no funds in the account(s). A temporary limitation has been placed on the</p>\r\n\r\n<p>account(s) that will allow funds to be received, but not withdrawn, and the account holder has<br />\r\nbeen notified to contact your office with questions regarding the restraint.<br />\r\n12/26/2018 Per Amex- No Accounts<br />\r\nPer Square</p>\r\n\r\n<p>Please be advised that the combined balance(s) for the above named merchant&rsquo;s 1 account(s)<br />\r\nas of 12/26/2018 is $0.00.</p>\r\n\r\n<p>Citibank - No Accounts<br />\r\n1/2/2019 5th 3rd- No Account<br />\r\n1/4/2019 Chase0 Below stat<br />\r\nHuntington- No Accounts<br />\r\nAmeris Bank- No Accounts<br />\r\n1/11/2019 US Bank- No Accounts<br />\r\nPNC- No Accounts<br />\r\nBankUnited- No Accounts<br />\r\nHSBC- No Accounts</p>\r\n\r\n<p><strong>Outside counsel&nbsp;</strong></p>\r\n\r\n<p>1/21/2020 Asked the outside counsel for an update.&nbsp;</p>\r\n\r\n<p>Case reopen&nbsp;</p>\r\n\r\n<p>Lizel, please send bank runs to&nbsp;WF, Chase, BOA, TD Bank, Citibank, Regions Bank, Fifth<br />\r\nThird Bank, BankUnited, BB&amp;T, US Bank, PNC, Huntington Bank, TD Bank, HSBC, BBVA, and Ameris Bank,<br />\r\nCitizens.</p>\r\n\r\n<p>Ashley, please get updates from PayPal and Square&nbsp;</p>\r\n\r\n<p>UCC to Amex&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 0, NULL, '2020-01-21 19:45:24', '2020-01-21 20:47:18', NULL),
