bsCSu8IPnCmeimW_d9JcR6b9xg4cHTd8eUxLQwYehwpqwSBPd26hapCN5wityNR_ha9Jxfg\" style=\"height:1px; width:1px\" /></strong></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Doreen,</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>We&#39;re ordering exemplified judgments on this matter which you have 2 judgments on for about $70,000.</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>This is a FL domiciled merchant so not the best state to pursue but we have some good collections firms down there who&#39;ll take a whack at it.</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>You&#39;ll get a copy of the forwarding letter when we receive the exemplified judgments.</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>Doug</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>Douglas E. Robinson, Esq. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />\r\nRTR Recovery, LLC<br />\r\n122 East 42nd Street, Suite 2112</strong></p>\r\n\r\n<p><strong>New York, NY 10168</strong></p>\r\n\r\n<p><strong>P. (718) 775-3673</strong></p>\r\n\r\n<p><strong>F. (888) 259-5884</strong></p>\r\n\r\n<p><strong>12/17/18: DR: Ms. Newman:</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>My name is Doug Robinson, I am the attorney for Roc Funding, the merchant cash advance company which provided you with a cash advance which you are currently in default on.</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>I&#39;m reaching out to you to see if you want to try and get this cash advance back on track.&nbsp; I have wide authority to alter your payment plan, if necessary, or change the payment frequency.</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>Noting the size of the open balance, if we don&#39;t reach a resolution, I will be sending this case to our FL collection law firm for immediate domestication of the judgment and at that time a fairly significant legal fee attaches.</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>Please take this opportunity to see if we can get you into a workable payment plan before this goes any further.</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>My contact information is below.</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>Thank you,&nbsp; Douglas Robinson&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>Per PayPal</strong></p>\r\n\r\n<p><strong>Dear Douglas Robinson :</strong></p>\r\n\r\n<p><strong>Thank you for contacting PayPal, Inc. (&quot;PayPal&quot;). We are in receipt of your UCC Lien Notice</strong></p>\r\n\r\n<p><strong>with regard to Joan Newman / R AND S ACCOUNTING AND MANAGEMENT CO, LLC. We</strong></p>\r\n\r\n<p><strong>have been unable to locate any records in our system associated with the information you</strong></p>\r\n\r\n<p><strong>provided. If you have additional information that would allow us to better identify the</strong></p>\r\n\r\n<p><strong>individual at issue, we are open to conducting further searches.</strong></p>\r\n\r\n<p><strong>12/28/2018 Citibank- No Accounts</strong></p>\r\n\r\n<p><strong>1/2/2019 5th 3rd- No Accounts&nbsp;</strong></p>\r\n\r\n<p><strong>1/4/2019 Citbank- No Accounts</strong></p>\r\n\r\n<p><strong>Chase- Account closed</strong></p>\r\n\r\n<p><strong>Huntington- No Accounts</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1/9/19 Sent to Marcadis Singer in FL (both judgments)</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1/11/2019 BankUnited- No Account</strong></p>\r\n\r\n<p><strong>Regions Bank- no accounts</strong></p>\r\n\r\n<p><strong>HSBC- No accounts</strong></p>\r\n\r\n<p><strong>PNC- No accounts/closed. new address for joan e. newman 8203 nw 74th ave tamarac, fl 33321-4856</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1/31/2019 Bams- No Accounts</strong></p>\r\n\r\n<p><strong>ACCOUNT WITH OUTSIDE COUNSEL</strong></p>\r\n\r\n<p><strong>1/22/2020 Update requested to the outside counsel&nbsp;</strong></p>\r\n\r\n<p><strong>Account reopen&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Lizel please send Bank runs to TD Bank, BOA, WF, Regions Bank, BB&amp;T, Citibank, Woodforest and Union Bank&nbsp;</p>\r\n\r\n<p>Ashley please send UCCs to Amex and PayPal&nbsp;</p>', 0, NULL, '2020-01-23 19:28:30', '2020-01-23 20:39:44', NULL),
