(56, 3, 109, 1, 'ROC Funding v. Starfish Transportation and Steven Cordell; our file no. 190005', '<blockquote>\r\n<p>Doug,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Per your email of September 23, 2019, &nbsp;I ordered the attached skip trace report on the above-referenced matter; the invoice for same is also attached.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Our office issued an alias asset examination directed to the new address in Oak Lawn.&nbsp; As such, do date your file ahead 60 days for a further report.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Joanna M.K. Kellogg<br />\r\n<br />\r\nKellogg Law Group, LLC<br />\r\n525 West Hawthorne Place, Suite 901<br />\r\nChicago, Illinois 60657<br />\r\nDirect: &nbsp;773-251-6214<br />\r\nFax: &nbsp;877-441-1487<br />\r\n<a href=\"mailto:joannamkellogg@me.com\" target=\"_blank\">joannamkellogg@me.com</a></p>\r\n</blockquote>', NULL, 0, '', '2020-01-23 20:47:56', '2020-01-23 20:47:56', NULL),
