(58, 3, 109, 1, 'Account reopen for collections 2nd Attempt', '<p>1st attempt updates&nbsp;</p>\r\n\r\n<p>Please be advised that the combined balance(s) for the above-named merchant&rsquo;s 2 account(s)<br />\r\nas of 1/3/2019 is $0.00. (Inactive)</p>\r\n\r\n<p>Fifth Third- Checking#7242577521 &amp; 7907552413 No funds av.<br />\r\nChase- acct closed</p>\r\n\r\n<p>Per Stripe<br />\r\nPayouts frozen, merchant notified. There&#39;s an existing lien for this merchant.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-23 20:52:43', '2020-01-23 20:52:43', NULL),
(59, 0, 109, 1, 'legal_scrub', 'legal_scrub', '<p>Banking with Fifth Third Bank<br />\r\nOther Cash Advances:<br />\r\n● Highspeed<br />\r\n● Bluevine Capital<br />\r\n● Kabagge<br />\r\n●<br />\r\nLiz please send UCCs to Stripe, Amex, PayPal and Square<br />\r\nInformation Subpoena to Noble Charter Schools (IL), and FD<br />\r\nMariel please send Bank runs to Fifth third Bank, Chase, US Bank, BMO Harris, PNC, BMO,<br />\r\nCitibank, Regions Bank, Woodforest, Bank of Hope, Signature Bank, Citizens Bank, preferred<br />\r\nBank, BMO Harris, BNY Mellon, WF, and BOA<br />\r\n10/17/18: DR:Mr. Cordell:</p>\r\n\r\n<p>My name is Doug Robinson, I am the attorney for Roc Funding, the merchant cash advance<br />\r\ncompany which provided you with a cash advance which you are currently in default on.<br />\r\nI&#39;m reaching out to you to see if you want to try and get this cash advance back on track. I have<br />\r\nwide authority to alter your payment plan, if necessary, or change the payment frequency.<br />\r\nNoting the size of the open balance, if we don&#39;t reach a resolution, I will be sending this case to<br />\r\nour Chicago collection law firm for immediate domestication of the judgment and at that time a<br />\r\nfairly significant legal fee attaches.<br />\r\nPlease take this opportunity to see if we can get you into a workable payment plan before this<br />\r\ngoes any further.<br />\r\nMy contact information is below.<br />\r\nThank you, Douglas Robinson<br />\r\n12/20/2018 Per Stripe<br />\r\nPayouts frozen, merchant notified. There&#39;s an existing lien for this merchant.<br />\r\nAsked Liz to please marshal the account</p>\r\n\r\n<p>12/28/2018 Per Amex- Might be processing with Intuit, Stripe and Capital One<br />\r\n1/5/2019 Per Square<br />\r\nHello,<br />\r\nPlease be advised that the combined balance(s) for the above named merchant&rsquo;s 2 account(s)<br />\r\nas of 1/3/2019 is $0.00.<br />\r\n1/14/2019 BMO- No Accounts<br />\r\nBank of Hope- No Accounts<br />\r\nWoodforest- No Accounts<br />\r\nPreferred Bank- No Accounts<br />\r\nBank Of America- No Account<br />\r\npnc- no accounts<br />\r\nregions- no accounts<br />\r\nsignature bank- no records found<br />\r\ncitibank- accounts closed</p>\r\n\r\n<p>1/23/2019 Fifth Third- Checking#7242577521 &amp; 7907552413 No funds av.<br />\r\nchase- acct closed<br />\r\n1/31/2019 US Bank- No Accounts<br />\r\nCitizens Bank- No Account<br />\r\n2/1/2019 RE: E30545 / STARFISH TRANSPORTATION INC<br />\r\nInbo<br />\r\nx<br />\r\nx</p>\r\n\r\n<p>NYC Marshal Biegel<br />\r\n&lt;nyc@marshalbiegel.co<br />\r\nm&gt;</p>\r\n\r\n<p>9:53 AM (6<br />\r\nhours ago)</p>\r\n\r\n<p>Good morning Elizabeth,</p>\r\n\r\n<p>Stripe is due to remit $703.07 within the next week or so. Once we receive the remittance in our office<br />\r\nthere will be a substantial balance of ~$40,449.61.</p>\r\n\r\n<p>Is there any additional asset information for the debtor in the meantime? Would you like me to re-levy<br />\r\nStripe?</p>\r\n\r\n<p>Thank you,<br />\r\nKrystale</p>\r\n\r\n<p>2/21/2019</p>\r\n\r\n<p>NYC Marshal Biegel<br />\r\n&lt;nyc@marshalbiegel.co<br />\r\nm&gt;</p>\r\n\r\n<p>Wed, Feb 20,<br />\r\n12:16 PM (1<br />\r\nday ago)</p>\r\n\r\n<p>Good morning Liz,</p>\r\n\r\n<p>Our office received the remittance from Strip on 2/11/19. The remittance was issued to your office on<br />\r\n2/18/19 for $652.92.</p>\r\n\r\n<p>There is still a remaining balance of $40,640.14 due as of today. Is there any additional asset information<br />\r\nfor the debtor?<br />\r\nACCOUNT WITH OUTSIDE COUNSEL</p>\r\n\r\n<p>1/23/2020 Account reopen&nbsp;</p>\r\n\r\n<p>Lizel please send bank runs to Fifth Third Bank, WF, BOA, US Bank, BMO Harris, Chase, Huntington Bank, Signature Bank, and Union Bank&nbsp;</p>\r\n\r\n<p>Ashley, please send UCC&#39;s to Square and Amex&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 0, NULL, '2020-01-23 20:58:27', '2020-01-23 20:58:27', NULL);
INSERT INTO `contact_notes` (`id`, `user_id`, `contact_id`, `note_type_id`, `note_title`, `note_content`, `legal_scrub`, `notify_user_id`, `cc_emails`, `created_at`, `updated_at`, `deleted_at`) VALUES
(60, 3, 109, 1, 'Update from the Outside counsel', '<p>Doug,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The alias asset examination was not served at the Oak Lawn address. &nbsp;The process server noted that during one of the three attempts at service, he spoke with an unidentified worker outside the home who confirmed that Mr. Cordell resided at the addresses, but that he was not home because &quot;some work was being done inside.&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Rather than issuing another alias asset examination that may not be served again at this address, our office attempted to confirm said address with the U.S. Post Office in order to obtain an affidavit to include as an exhibit to a motion for alternative service via posting and U.S. mail. &nbsp;Recently, our office received the following response to our request for validation of the Oak Lawn address from the U.S. Post Office:&nbsp;&ldquo;moved, left no forwarding address.&rdquo; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>At this&nbsp;point, we can either try to issue another asset examination (the 3rd overall) to the Oak Lawn address (&ldquo;Option A&rdquo;), OR we can try to file a motion for alternative service and include as exhibits only the skip trace report and the affidavit of non-service, but I&rsquo;m not sure the statement of an unidentified worker will be sufficient to convince a judge of allowing service by posting (&ldquo;Option B&rdquo;).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>There are approximately $73.00 left in unused court costs, which should be enough to go forward with either option. &nbsp;What is your client&rsquo;s preference?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Joanna M. K. Kellogg</p>\r\n\r\n<p><img src=\"https://ssl.gstatic.com/ui/v1/icons/mail/images/cleardot.gif\" /></p>', NULL, 0, '', '2020-01-23 21:03:48', '2020-01-23 21:03:48', NULL),
(61, 0, 110, 1, 'legal_scrub', 'legal_scrub', '<p>NYSCEF: Good<br />\r\nBanking with TD Bank- I cannot check the account (passcode is needed).<br />\r\nProcessing with Heartland MID: 650000003674325<br />\r\nOther Cash Advances:<br />\r\n● Fundkite<br />\r\n● Kash Capital<br />\r\n● Forward Financing</p>\r\n\r\n<p>Liz please send UCCs to Square MID: 181101Q2 L209395274399, Paychex, PayPal, Amex, and Heartland<br />\r\nMID: 650000003674325</p>\r\n\r\n<p>Jess please send Information Subpoena to United Software Solutions Inc<br />\r\nhttp://www.unitedsoftware.us/movingsoftware/aboutus.html<br />\r\nBank runs to TD Bank, BOA, WF, Regions, BBVA, Santander, BB&amp;amp;T, Citizens Bank, KeyBank, PNC,<br />\r\nWoodforest, M&amp;amp;T, Investors Bank, and Chase<br />\r\nI&rsquo;ll send the Judgment to TD Bank, Heartland and Square</p>\r\n\r\n<p>12/17/2018 Heartland</p>\r\n\r\n<p>Good Afternoon Liz,<br />\r\nHeartland has elected to established a reserve for SVJ, Inc (&amp;quot;Merchant&amp;quot;) and there is a small<br />\r\nbalance. However, Heartland Payment Systems, LLC (&amp;quot;Heartland&amp;quot;) has received competing<br />\r\nclaims from multiple creditors concerning certain balances considered in default, of which<br />\r\ncontains a senior UCC filing. Heartland respectfully requests that each disputing party mutually<br />\r\nresolve the matter with the merchant and provide Heartland notice of the resolution. If resolution<br />\r\ncannot be reached Heartland will exercise its rights under that Merchant Processing Agreement<br />\r\n(&amp;quot;Agreement&amp;quot;) by and between SVJ, Inc. and Heartland to immediately terminate the Agreement<br />\r\nwith the merchant; hold the funds in reserve and not release them to any party given our senior<br />\r\ncontractual position.</p>\r\n\r\n<p>The merchant has not processed since 12/04/2018 when Heartland was attempting to collect its<br />\r\nown outstanding balances. The balance in reserve will likely be depleted to cover the fees in<br />\r\ncollection. It appears the merchant has switched processors.</p>\r\n\r\n<p>Thank you,<br />\r\nJames Hodges<br />\r\nLegal Assistant</p>\r\n\r\n<p>Heartland<br />\r\nPer PayPal</p>\r\n\r\n<p>Thank you for contacting PayPal, Inc. We are in receipt of your UCC Lien Notice with<br />\r\nregard to SVJ INC. We have limited access to the following PayPal account(s) pursuant to the</p>\r\n\r\n<p>above-referenced UCC Lien Notice:<br />\r\nPayPal accounts<br />\r\nSteven Jamison<br />\r\nsjami1@verizon.net<br />\r\n$4259.15<br />\r\nVALERIE JAMISON<br />\r\nVALJAM@VERIZON.NET<br />\r\n$0<br />\r\nWe have withheld the funds from the account(s) in the amount of $ and are currently<br />\r\nprocessing a check for the amount listed above. We will send the check to your office via<br />\r\ncertified mail as soon as it has been processed.<br />\r\n12/19/2018 Per Square<br />\r\nHello,</p>\r\n\r\n<p>Please be advised that the combined balance(s) for the above named merchant&rsquo;s 1 account(s)<br />\r\nas of 12/18/2018 is $2,174.69.<br />\r\n12/21/2018 Amex- Account on hold<br />\r\nAlso the merchant might be processing with PayPal, Square and Heartland<br />\r\n1/3/2019 KeyBank- No Accounts</p>\r\n\r\n<p>1/4/2019 Chase- no accounts<br />\r\nM&amp;amp;T- No Accounts<br />\r\nPNC- No Accounts<br />\r\nWoodforest- No Accounts<br />\r\n1/7/19 Santander holding $8,013, Liz sent execution to Biegle 1/7. Daren notified.<br />\r\nCitizens Bank- No Accounts<br />\r\nBB&amp;amp;T- No Accounts<br />\r\nInvestors Bank- No Accounts<br />\r\nREGIONS- NO ACCOUNTS<br />\r\n2/4/2019</p>\r\n\r\n<p>Good morning,</p>\r\n\r\n<p>&middot; Square responded there are &ldquo;senior&rdquo; liens in place. I am trying to get a date as to when those<br />\r\n&ldquo;senior&rdquo; liens have been served and when they are due to expire so that we can re-levy at the right time.<br />\r\nI will keep you apprised.</p>\r\n\r\n<p>Thank you,<br />\r\nKrystale<br />\r\nAny case, I asked Square for an update<br />\r\n2/11/2019</p>\r\n\r\n<p>Good morning Carolina,</p>\r\n\r\n<p>I tried getting our levy placed but was unsuccessful. Apparently Square was also served with a Marshal&rsquo;s<br />\r\nlevy for Jacob (meaning Jacob does have a judgment). Additionally, they are honoring the senior lien<br />\r\nthat was perfected first.</p>\r\n\r\n<p>When it comes to UCC Lien&rsquo;s the entities legal compliance usually have their own policies as far as how<br />\r\nto place priority. Although we will dispute with them every time please understand we are never in a<br />\r\nposition to force them to change their policies.</p>\r\n\r\n<p>Thank you,<br />\r\nKrystale</p>\r\n\r\n<p>2/21/2019 Per the Marshal</p>\r\n\r\n<p>Hello Carolina,<br />\r\nSantander remitted $10,868.81 to our office yesterday. I will update you once we receive the<br />\r\nremittance. In the meantime is there any additional asset information for the debtor?</p>\r\n\r\n<p>3/4/2019 Asked the Marshal for an update from TD Bank since we never got a response<br />\r\n4/3/2019 BBVA No accounts<br />\r\n4/23/2019 Case reopen<br />\r\nAshley please send bank runs to TD, Santander, BOA, BB&amp;amp;T, Citizens Bank, HSBC,<br />\r\nKeyBank, M&amp;amp;T Bank, PNC, WF, Huntington Bank, and Woodforest<br />\r\nLiz UCCs to Square and PayPal<br />\r\n5/6/2019 Keybank No accounts<br />\r\n5/20/2019 Citizens Bank - No Accounts<br />\r\n5/31/2019 Santander &ndash; Account on hold<br />\r\n6/3/2019 Huntington- No Accounts<br />\r\nBOA- No Accounts<br />\r\n6/17/2019 WF- No Accounts</p>\r\n\r\n<p>NYC Marshal Biegel&nbsp;&amp;lt;nyc@marshalbiegel.com&amp;gt; Tue, Jul 30,<br />\r\n10:25 AM (2<br />\r\ndays ago)</p>\r\n\r\n<p>to&nbsp;Elizabeth,&nbsp;me,&nbsp;Doug</p>\r\n\r\n<p>Hello Carolina,<br />\r\n&nbsp;<br />\r\nDiscover responded no accounts.<br />\r\nAmex responded a hold is placed on the account. However, the debtor has not processed with them<br />\r\nsince the ending of 2018. Amex also responded the debtor is processing payments with First Data and<br />\r\nPayPal Inc.</p>\r\n\r\n<p>&nbsp;<br />\r\nWould you like me to serve FD &amp;amp; PayPal? Kindly advise. The amount due as of today is $26,413.29.<br />\r\n&nbsp;<br />\r\nThank you,<br />\r\nKrystale<br />\r\n&nbsp;<br />\r\nPer Square</p>\r\n\r\n<p>Emily Ehrlich Mon, Sep 23,<br />\r\n4:58 PM (20<br />\r\nhours ago)</p>\r\n\r\n<p>to&nbsp;me</p>\r\n\r\n<p>Hi Carolina,<br />\r\nThe account currently has a negative balance and hasn&amp;#39;t been used since November 2018.<br />\r\n10/4 New Bank statements received<br />\r\nFwd: New Submission - Platinum Moving Corp from Shore<br />\r\nFunding<br />\r\nInbox x</p>\r\n\r\n<p>Daren Roc Wed, Oct 2,<br />\r\n6:02 PM (2<br />\r\ndays ago)</p>\r\n\r\n<p>to&nbsp;Doug,&nbsp;me</p>\r\n\r\n<p>SVJ MOVING NEW BUSINESS&nbsp;</p>\r\n\r\n<p>PLATINUM MOVING CORP- new company<br />\r\nAshley please send UCCs to FD MID: 520003512587<br />\r\nStephanie please send bank runs to PNC, BOA, WF, Santander, BB&amp;T, Citizens Bank, TD<br />\r\nBank, Citibank and KeyBank</p>\r\n\r\n<p>Please use EIN number 83-3143415<br />\r\n10/17/2019 BoA No accounts<br />\r\n10/22/2019 Key Bank No accounts<br />\r\nPNC- No Accounts<br />\r\n10/29/2019 Citibank No accounts<br />\r\n10/29/2019 TD bank No accounts<br />\r\n10/29/2019 Citizens Bank No accounts<br />\r\n10/30/2019 BB&amp;T No accounts<br />\r\n11/4/2019 Santander No accounts<br />\r\n11/8/2019 TD Bank acct 467237749 Bal. $0.90<br />\r\n1/2/2020 FD<br />\r\nMorning &ndash; we have finished reviewing our records and we do not have any open/active<br />\r\naccounts for this merchant.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1/23/2020 Account reopen&nbsp;</p>\r\n\r\n<p>Lizel please send Bank runs to TD Bank, BOA, Santander, Citizens Bank, WF, BB&amp;T, PNC, Citibank, KeyBank, and Chase&nbsp;</p>\r\n\r\n<p>Ashley please send UCC&#39;s to PayPal, Worldpay and Square&nbsp;</p>', 0, NULL, '2020-01-23 21:58:34', '2020-01-23 21:58:34', NULL),
