(65, 3, 112, 1, 'TET#:99097 ROC FUNDING vs. TEA BAR & ORGANIC, INC', '<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:auto\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"height:auto; text-align:left; vertical-align:top; white-space:nowrap; width:1231.81px\">\r\n			<table cellspacing=\"0\" style=\"width:1231px\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3><strong>Elizabeth T. Garcia</strong>&nbsp;&lt;etorres@tetlegal.com&gt;</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">\r\n			<p>Sun, Dec 29, 2019, 4:43 PM</p>\r\n			</td>\r\n			<td style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">\r\n			<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n\r\n			<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"height:auto\">\r\n			<table cellspacing=\"0\" style=\"width:1504px\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"white-space:nowrap\">\r\n						<p>to&nbsp;<span dir=\"ltr\">me</span></p>\r\n\r\n						<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>In reference:<br />\r\n&nbsp;&nbsp; RE:&nbsp; ROC FUNDING<br />\r\n&nbsp;&nbsp; VS:&nbsp; TEA BAR &amp; ORGANIC, INC<br />\r\n&nbsp;&nbsp; TET File Number: 99097</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Receiver reports the bank freeze letter issued on the debtor&#39;s bank account reports the account to be closed. The Receiver has issued a summons for the debtor