(66, 0, 112, 1, 'legal_scrub', 'legal_scrub', '<p>2 Judgments. Big balances<br />\r\nBanking with Chase<br />\r\nProcessing with FD/ WF MID: 422369510004624<br />\r\nReceivables:<br />\r\n● Uber MID:1320456349<br />\r\n● Grubhub MID:1261328194<br />\r\n● Square MID: 9424300002<br />\r\nJess please send Bank runs to Chase, WF, BOA, Capital One, Woodforest, BBVA,<br />\r\nRegions Bank, Comerica, BB&amp;amp;T, Preferred Bank, and TD Bank<br />\r\nInformation subpoena to FD MID: 422369510004624</p>\r\n\r\n<p>Liz please send UCCs to Amex, PayPal, FD/ WF MID: 422369510004624 and other<br />\r\nreceivables<br />\r\n12/17/18 DR: Mr. Wang:<br />\r\nMy name is Doug Robinson, I am the attorney for Roc Funding, the merchant cash advance<br />\r\ncompany which provided you with a cash advance which you are currently in default on.<br />\r\nI&amp;#39;m reaching out to you to see if you want to try and get this cash advance back on track. I have<br />\r\nwide authority to alter your payment plan, if necessary, or change the payment frequency.<br />\r\nNoting the size of the open balance, if we don&amp;#39;t reach a resolution, I will be sending this case to<br />\r\nour TX collection law firm for immediate domestication of the judgment and at that time a fairly<br />\r\nsignificant legal fee attaches.<br />\r\nPlease take this opportunity to see if we can get you into a workable payment plan before this<br />\r\ngoes any further.<br />\r\nMy contact information is below.<br />\r\nThank you, Douglas Robinson<br />\r\n1/11/2019 Chase- Account#2003 below balance<br />\r\n1/15/2019 Comerica- No Accounts<br />\r\nREGIONS- NO ACCOUNTS</p>\r\n\r\n<p>Richard Coviello</p>\r\n\r\n<p>Tue, Jun 4,<br />\r\n3:25 PM (3<br />\r\ndays ago)</p>\r\n\r\n<p>to me</p>\r\n\r\n<p>Good Afternoon Nerissa ,</p>\r\n\r\n<p>We have resolved claims with outside counsel, in execution stages, on domesticated judgments<br />\r\nfor a reduction and terms, for this creditor,<br />\r\nas recently as February of this year. Submitting to us that they &lsquo;must&rsquo; is a bit absolutist.<br />\r\nWe would present they &lsquo;will&rsquo; not, at this time, if we were to bring it to a client today.</p>\r\n\r\n<p>We cannot meet any demands for the moment, this client is not likely to survive the month.</p>\r\n\r\n<p>5/22/2019<br />\r\nWe spoke w /Mr. Wang.<br />\r\nHis landlord evicted him due to the calls from the MCA companies. He is no longer in<br />\r\nbusiness... he says it will cost 7k to file BK and he doesn`t have it.<br />\r\nWe will be moving to close this file shortly.</p>\r\n\r\n<p>Thanking You in Advance for Your Efforts,<br />\r\nRich Coviello<br />\r\n7/15/2019<br />\r\nElizabeth Heng 12:08 PM<br />\r\n(3 hours<br />\r\nago)</p>\r\n\r\n<p>to&nbsp;me</p>\r\n\r\n<p>Hello Elizabeth,<br />\r\nTea Bar and Organics, does not have an active Grubhub account.&nbsp;&nbsp;</p>\r\n\r\n<p>Best,<br />\r\nKatrina<br />\r\nPayment Team Specialist<br />\r\nGrubhub<br />\r\n7/17/2019 Square<br />\r\nGood afternoon,<br />\r\nThis is in regards to the lien above.<br />\r\nWe are not able to process this lien at this time as ABF and AMA are the senior liens.<br />\r\nSince ABF and AMA&nbsp;are the senior liens, we will need to wait for an official release<br />\r\nbefore processing the lien. Once the release has been provided, please re submit the<br />\r\nlien to be processed.<br />\r\nThank you,<br />\r\nSquare Civil Process&rdquo;</p>\r\n\r\n<p><strong>OUTSIDE ATTORNEY</strong></p>\r\n\r\n<table cellspacing=\"0\" style=\"width:auto\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"height:auto; text-align:left; vertical-align:top; white-space:nowrap; width:1259px\">\r\n			<table cellspacing=\"0\" style=\"width:1259px\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3><strong>Elizabeth T. Garcia</strong>&nbsp;&lt;etorres@tetlegal.com&gt;</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">\r\n			<p>Dec 29, 2019, 4:43 PM</p>\r\n			</td>\r\n			<td style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">\r\n			<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n\r\n			<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"height:auto\">\r\n			<table cellspacing=\"0\" style=\"width:1504px\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"white-space:nowrap\">\r\n						<p>to&nbsp;<span dir=\"ltr\">me</span></p>\r\n\r\n						<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>In reference:<br />\r\n&nbsp;&nbsp; RE:&nbsp; ROC FUNDING<br />\r\n&nbsp;&nbsp; VS:&nbsp; TEA BAR &amp; ORGANIC, INC<br />\r\n&nbsp;&nbsp; TET File Number: 99097</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Receiver reports the bank freeze letter issued on the debtor&#39;s bank account reports the account to be closed. The Receiver has issued a summons for the debtor to appear and provide testimony and financial documents mid-January, 2020. Please advance your file an additional forty (40) days and we will advise as to the Receiver&#39;s examination hearing outcome.</p>\r\n\r\n<p>Very truly yours,</p>\r\n\r\n<p>JON D. TOTZ<br />\r\nATTORNEY AT LAW<br />\r\nTOTZ ELLISON &amp; TOTZ, P.C.<br />\r\n2211 NORFOLK, SUITE 510<br />\r\nHOUSTON, TEXAS 77098<br />\r\nPHONE: (713) 275-0303 FAX: (713) 275-0304</p>\r\n\r\n<p>&nbsp;</p>', 0, NULL, '2020-01-23 22:36:04', '2020-01-23 22:36:04', NULL),
(67, 3, 111, 1, 'TET#:99097 ROC FUNDING vs. TEA BAR & ORGANIC, INC', '<p>In reference:<br />\r\n&nbsp;&nbsp; RE:&nbsp; ROC FUNDING<br />\r\n&nbsp;&nbsp; VS:&nbsp; TEA BAR &amp; ORGANIC, INC<br />\r\n&nbsp;&nbsp; TET File Number: 99097</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Receiver reports the bank freeze letter issued on the debtor&#39;s bank account reports the account to be closed. The Receiver has issued a summons for the debtor to appear and provide testimony and financial documents mid-January, 2020. Please advance your file an additional forty (40) days and we will advise as to the Receiver&#39;s examination hearing outcome.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-23 22:38:10', '2020-01-23 22:38:10', NULL),
(68, 3, 96, 1, 'Roc v. Parts Shack; j17-3103', '<p>1/21/2020 Darren</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I don&rsquo;t know why the J from NY was not entered vs. Lobello. I don&rsquo;t know what his financial status is. The corp you have the J against is gone. However, there is another Lobello business at the location now. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If your guaranty by Lobello will hold up in court (don&rsquo;t see why it would not), we could get a jdgument against him in NJ which would be good for 20 years. If he has an interest &nbsp;in the Lobello business at the Parts Shack location, we can levy his interest.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Cary</p>', NULL, 0, '', '2020-01-23 23:14:29', '2020-01-23 23:14:29', NULL),
(69, 0, 96, 1, 'legal_scrub', 'legal_scrub', '<p>Banking with Ocean First Bank- Out of Jurisdiction<br />\r\nMight have an account with BOA<br />\r\nOther Cash Advances:<br />\r\n● Yellowstone<br />\r\n● Orange Advance<br />\r\nLiz please send UCCs to Amex, Synchrony Bank, PayPal<br />\r\nInformation Subpoena to Napa Auto Parts- headquarters</p>\r\n\r\n<p>Jess please send Bank runs to Santander, PNC, M&amp;amp;T, TD, WF, BOA, OceanFirst Bank, Chase,<br />\r\nProvident Bank, Investors Bank, Citizens Bank, Apple Bank, Country Bank, Union Bank, TD<br />\r\nBank, BBVA, Comerica, Capital Bank, Huntington Bank, Regions Bank, and Capital One.<br />\r\n12/13/2018 Per PayPal- No Account<br />\r\n12/17/18. DR.<br />\r\nMr. Wang:<br />\r\nMy name is Doug Robinson, I am the attorney for Roc Funding, the merchant cash advance<br />\r\ncompany which provided you with a cash advance which you are currently in default on.<br />\r\nI&amp;#39;m reaching out to you to see if you want to try and get this cash advance back on track. I have<br />\r\nwide authority to alter your payment plan, if necessary, or change the payment frequency.<br />\r\nNoting the size of the open balance, if we don&amp;#39;t reach a resolution, I will be sending this case to<br />\r\nour TX collection law firm for immediate domestication of the judgment and at that time a fairly<br />\r\nsignificant legal fee attaches.<br />\r\nPlease take this opportunity to see if we can get you into a workable payment plan before this<br />\r\ngoes any further.<br />\r\nMy contact information is below.<br />\r\nThank you, Douglas Robinson<br />\r\n18 at 9:53 AM<br />\r\nSubject: my ACCOUNT<br />\r\nTo: &amp;lt;drobinson@rtrrecoveryllc.com&amp;gt;</p>\r\n\r\n<p>You guys know I&amp;#39;m going to pay it&amp;#39;s just a matter of time, I don&amp;#39;t make the turnarounds that you guys do,<br />\r\nYou took me for everything I have and now a employee.<br />\r\nFor the past year I&amp;#39;ve been a loyal client. I sold everything I have, had to give up my house &amp;amp; business.<br />\r\nSo as soon as the business gets back on track and I can start collecting my bonuses I can pay you and<br />\r\nthat will hopefully start in 5-8 weeks.<br />\r\nIf you want to make my life more miserable then go ahead and the last thing I have ruin, my family.<br />\r\nThere&#39;s nothing else for me to loose....<br />\r\nᐧ</p>\r\n\r\n<p>Doug Robinson</p>\r\n\r\n<p>Sorry to hear of your issues.<br />\r\nRoc, as always, remains willing to work with you.<br />\r\nWhat is the minimal amount you can pay on a daily basis?<br />\r\nLet me know this morning, please.</p>\r\n\r\n<p><br />\r\n5/20/2019 Regions- No Accounts<br />\r\n5/22/2019 Apple Bank- No Accounts<br />\r\nPNC- No Accounts<br />\r\nComerica- No Accounts<br />\r\n5/28/2019 Huntington Bank&mdash;No Accounts<br />\r\nChase- No Accounts<br />\r\nNavy Federal Credit Union- No Accounts<br />\r\nOceaFirst Bank- Account#24006001652 $11.00<br />\r\nBOA- Account#005240001643 $0.00<br />\r\nAccount#000978728168 $-153.13<br />\r\nACCOUNT WITH OUTSIDE COUNSEL<br />\r\n6/10/2019 Citizens- No Accounts<br />\r\nSantander- No Accounts</p>\r\n\r\n<p>1/23/2020</p>\r\n\r\n<p>To: Daren Roc &lt;<a href=\"mailto:daren@rocfundinggroup.com\" target=\"_blank\">daren@rocfundinggroup.com</a>&gt;, Doug Robinson &lt;<a href=\"mailto:drobinson@rtrrecoveryllc.com\" target=\"_blank\">drobinson@rtrrecoveryllc.com</a>&gt;<br />\r\nCc: doreen scarciofolo &lt;<a href=\"mailto:dscarciofolo@rocfundinggroup.com\" target=\"_blank\">dscarciofolo@rocfundinggroup.com</a>&gt;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>Darren</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I don&rsquo;t know why the J from NY was not entered vs. Lobello. I don&rsquo;t know what his financial status is. The corp you have the J against is gone. However, there is another Lobello business at the location now. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If your guaranty by Lobello will hold up in court (don&rsquo;t see why it would not), we could get a jdgument against him in NJ which would be good for 20 years. If he has an interest &nbsp;in the Lobello business at the Parts Shack location, we can levy his interest.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Cary</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>Cary Richard Sternback, Esq.</strong></p>\r\n\r\n<p><strong>President &amp; Managing Attorney</strong></p>\r\n\r\n<p><strong>Heitner &amp; Breitstein P.C.</strong></p>\r\n\r\n<p><strong><a href=\"tel:%28732%29780-5900\" target=\"_blank\">(732)780-5900</a>&nbsp;Marlboro</strong></p>\r\n\r\n<p><strong><a href=\"tel:%28718%29%20748-8080\" target=\"_blank\">(800) 221-6567</a>&nbsp;Brooklyn</strong></p>\r\n\r\n<p><strong><a href=\"mailto:sternback@heitnerbreitstein.com\" target=\"_blank\">sternback@nycnjlaw.com</a></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Account reopen for collections&nbsp;</strong></p>\r\n\r\n<p>Lizel please send bank runs to M&amp;T, TD Bank, Santander, WF, PNC, BOA, and OceanFirst Bank</p>\r\n\r\n<p>Ashley, please send UCC&#39;s to PayPal, Square, Worldpay and Amex&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 0, NULL, '2020-01-23 23:32:56', '2020-01-23 23:35:29', NULL),
