(78, 0, 116, 1, 'legal_scrub', 'legal_scrub', '<p>Jess please send UCCs to Amex MID: 100218, Integrity Payments, Paymentech MID: 100118, and PayPal.</p>\r\n\r\n<p>Mariel please send Bank runs to Navy Federal Credit Union, BOA, M&amp;T, WF, Citibank, PNC, BB&amp;T, Provident Bank, Capital One, Union Bank, United Bank, TD Bank, Chase, and Citizens Bank</p>\r\n\r\n<p>Liz please Marshal Navy Federal Credit Union, Paymentech MID: 100118 and Amex.<br />\r\n&nbsp;</p>\r\n\r\n<p>1/21/2019 Per Integrity Payments</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:929.6pt\">\r\n			<table cellspacing=\"0\" style=\"width:929.25pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3><strong>Gina Loffredi</strong></h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p>11:46 AM (43 minutes ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:15.0in\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Jessica,&nbsp;me</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>IPS has placed Bang Theory Salon (409162100002492) in full suspense and sent notification to all parties involved.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>IPS will not release funds to any parties involved until a payment agreement is received signed by all parties involved and/or a court order is received directing IPS on how funds on hold are to be disbursed.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please note, any funds owed to IPS will be deducted from all funds on hold prior to funds being released to any parties involved.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you!!</p>\r\n\r\n<p>1/23/2019 Per Paymentech</p>\r\n\r\n<p><img alt=\"https://ssl.gstatic.com/ui/v1/icons/mail/profile_mask2.png\" src=\"https://ssl.gstatic.com/ui/v1/icons/mail/profile_mask2.png\" style=\"height:32px; width:32px\" /></p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:930.7pt\">\r\n			<table cellspacing=\"0\" style=\"width:930.0pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3><strong>Contract Admin</strong></h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p><img alt=\"Attachments\" src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABAQMAAAAl21bKAAAABlBMVEXAwMAAAAAr16GmAAAAAXRSTlMAQObYZgAAAAxjbVBQSkNtcDA3MTIAAAAHT223pQAAAApJREFUGNNjYAAAAAIAAZhjbNcAAAAASUVORK5CYII=\" style=\"height:1px; width:1px\" />9:21 AM (2 hours ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:15.0in\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Contract Admin,&nbsp;me,&nbsp;jdesoto@rtrrecoveryllc.com</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Hello,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This email confirms that the Merchant&rsquo;s account has been placed on hold.&nbsp; In accordance with Paymentech&rsquo;s procedures, please complete all text boxes in the attached Indemnity Agreement and return a copy, signed by an authorized representative of Secured Lender and your department as applicable. If there are any questions regarding the indemnification agreement, please let me know.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Per PayPal</p>\r\n\r\n<p>Thank you for contacting PayPal, Inc. (&quot;PayPal&quot;). We are in receipt of your UCC Lien Notice with</p>\r\n\r\n<p>regard to BANG THEORY SALON INC. We have located the following PayPal account(s) that are</p>\r\n\r\n<p>subject to the above-referenced UCC Lien Notice:</p>\r\n\r\n<p>PayPal accounts</p>\r\n\r\n<p>Dawn Garrett</p>\r\n\r\n<p>info@bangtheorysalons.com</p>\r\n\r\n<p>$0</p>\r\n\r\n<p>Dawn Brown</p>\r\n\r\n<p>bangtheorysalon@gmail.com</p>\r\n\r\n<p>$0</p>\r\n\r\n<p>Dawn Garrett</p>\r\n\r\n<p>taimarenterprises@gmail.com</p>\r\n\r\n<p>$-268.01</p>\r\n\r\n<p>Dawn Garrett</p>\r\n\r\n<p>thedawn26@gmail.com</p>\r\n\r\n<p>$0</p>\r\n\r\n<p>There are currently no funds in the account(s). A temporary limitation has been placed on the</p>\r\n\r\n<p>account(s) that will allow funds to be received, but not withdrawn, and the account holder has</p>\r\n\r\n<p>been notified to contact your office with questions regarding the restraint.</p>\r\n\r\n<p>2/1/2019 Strategic funding has a prior UCC from February 22, 2017, our UCC is From April 16, 2018.</p>\r\n\r\n<p>&n