(87, 3, 138, 1, 'ROC Funding v. Steven M. Senna d/b/a Swimming Pool & Spa Design; 19-1-107', '<p>Doug,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mr. Senna has now filed the attached Answer and the Court has scheduled a hearing for 10/8/19.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>What I would like from you is a breakdown of all funds given to Senna and all payments he made from the beginning of time on this (including any and all amounts &quot;seized&quot;). &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>At a bare minimum, I need to show the Judge EXACTLY how we arrived at the original Judgment figure.&nbsp; I will also be requesting an Affidavit from the client as I intend to move for Summary Judgment.&nbsp; I will be away next week, but I would like to revisit this matter shortly after Labor Day.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>Michael</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:auto\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"height:auto; text-align:left; vertical-align:top; white-space:nowrap; width:1231.13px\">\r\n			<table cellspacing=\"0\" style=\"width:1231px\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3><strong>reports@rocfundinggroup.com</strong></h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">\r\n			<p><img alt=\"Attachments\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; margin-right:6px; margin-top:-3px; width:20px\" />Aug 23, 2019, 9:40 AM</p>\r\n			</td>\r\n			<td style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">\r\n			<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n\r\n			<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"height:auto\">\r\n			<table cellspacing=\"0\" style=\"width:1503px\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"white-space:nowrap\">\r\n						<p>to&nbsp;<strong><span dir=\"ltr\">mzolaesq</span></strong>,&nbsp;<strong><span dir=\"ltr\">doreen</span></strong>,&nbsp;<span dir=\"ltr\">Daren</span>,&nbsp;<span dir=\"ltr\">me</span>,&nbsp;<span dir=\"ltr\">calcaraz</span></p>\r\n\r\n						<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>It is quite simple.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>On 7/19/2018; Mr. Senna on behalf of Swimming Pool Spa and Design agreed in contract to offer $42,600.00 in future receipts for $30,000 in immediate funding.</li>\r\n	<li>On 7/19/2018 the ROC Funding Group wired $30,000.00 to Mr. Senna in the account of Swimming Pool Sap and Design.</li>\r\n	<li>Subsequently, the account of Swimming Pool Spa and design began paying ROC funding on 7/25/2018 as agreed.</li>\r\n	<li>Sometime in Mid-August; the merchant requested and adjustment to agreed rate of payment in the contract and we modified the payment plan.</li>\r\n	<li>On November 8, 2018 the merchant decided to stop paying as agreed all together.</li>\r\n	<li>Between 7/25/2018 and November 8, 2018 the merchant&rsquo;s total sum payments to the ROC funding Group is $8,744.87.</li>\r\n	<li>There remains an open balance of receipts purchased due to ROC Funding in the amount of: $33,855.13.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>These attachments shall provide all the support needed for the above information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong><em>Contract and COJ</em></strong></li>\r\n	<li><strong><em>Bank Statement with wired funds</em></strong></li>\r\n	<li><strong><em>Merchant Pay history</em></strong></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mr. Robinson has information related to the &ldquo;amounts seized&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks</p>\r\n\r\n<table cellpadding=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table cellpadding=\"0\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>Michael A. Zola, Esq.&nbsp;&lt;mzolaesq@gmail.com&gt;</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td>\r\n			<p>Oct 4, 2019, 6:23 PM</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n			<td rowspan=\"2\">\r\n			<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" /></p>\r\n\r\n			<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellpadding=\"0\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;me</p>\r\n\r\n						<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Good afternoon Doug,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Quick question on this account.&nbsp; Why was the confession of Judgment and agreement signed at the same time?&nbsp; I see the actual Judgment issued on 11/19/18 but the confession was signed back in July when the funds were initially wired...</p>\r\n\r\n<p><img src=\"https://ssl.gstatic.com/ui/v1/icons/mail/profile_mask2.png\" style=\"height:40px; width:40px\" /></p>\r\n\r\n<table cellspacing=\"0\" style=\"width:auto\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"height:auto; text-align:left; vertical-align:top; white-space:nowrap; width:1260.8px\">\r\n			<table cellspacing=\"0\" style=\"width:1260px\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3><strong>reports@rocfundinggroup.com</strong></h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">\r\n			<p>Oct 5, 2019, 10:43 AM</p>\r\n			</td>\r\n			<td style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"height:auto; text-align:right; vertical-align:top; white-space:nowrap\">\r\n			<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n\r\n			<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"height:auto\">\r\n			<table cellspacing=\"0\" style=\"width:1504px\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"white-space:nowrap\">\r\n						<p>to&nbsp;<strong><span dir=\"ltr\">doreen</span></strong>,&nbsp;<span dir=\"ltr\">mzolaesq</span>,&nbsp;<span dir=\"ltr\">Daren</span>,&nbsp;<span dir=\"ltr\">me</span></p>\r\n\r\n						<p><img alt=\"\" src=\"https://mail.google.com/mail/u/1/images/cleardot.gif\" style=\"height:20px; width:20px\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Hi Mike,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I am sure that Doug can confirm that with EVERY revenue advance the confession of judgment is signed before funds are advanced to the merchant.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-24 17:46:48', '2020-01-24 17:47:19', '2020-01-24 17:47:19'),
