(131, 0, 135, 1, 'legal_scrub', 'legal_scrub', '<p>NYSCEF: Good</p>\r\n\r\n<p>Banking with Woodforest</p>\r\n\r\n<p>Other Cash Advances:</p>\r\n\r\n<ul>\r\n	<li>ML Factors</li>\r\n	<li>Quickbridge Funding</li>\r\n	<li>Bluevine</li>\r\n	<li>Flat Rate Funding</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Receivables:</p>\r\n\r\n<ul>\r\n	<li>SYNERGY SAND</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n\r\n<p>Mariel please send Bank runs to BMO Harris, Woodforest, Fifth Third Bank, PNC, US Bank, Huntington Bank, Chase, KeyBank, WF and BOA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Liz please send UCCs to PayPal, Square, Amex and Synergy Sand</p>\r\n\r\n<p>Per Liz</p>\r\n\r\n<p><img alt=\"Elizabeth Heng (eheng@rtrrecoveryllc.com)\" src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAACAAAAAgCAIAAAD8GO2jAAAAgklEQVR42mN441BFU8QwasGoBaMWEGmBZ8PboDZM9Ma9njoWfFuw9z828GXiJmpa8Kly0Yf0qcjorX8LNS14F9FFqzgYLhb8e/vp7+uPcPR90ykqW/B15o7P3evg6GPR3NE4oLcFn9tXfyybj4zeRffStqj4tnj/aHE9asGoBSPCAgD6C9IiNXFwDwAAAABJRU5ErkJggg==\" style=\"height:24pt; width:24pt\" /></p>\r\n\r\n<p>274/2019 is the index number for smartway express</p>\r\n\r\n<p>Bmo harris- no accounts</p>\r\n\r\n<p>Wells fargo- no accounts</p>\r\n\r\n<p>1/31/2019 Chase- No Accounts</p>\r\n\r\n<p>KeyBank- No Accounts</p>\r\n\r\n<p>PNC- No Accounts</p>\r\n\r\n<p>Woodforest National Bank- Account#1575000078 overdrawn</p>\r\n\r\n<p>Account#1575351562 $200 federal benefits</p>\r\n\r\n<p>Account#1446335307 $640.12 bellow exempt.</p>\r\n\r\n<p>2/1/2019 Per the Marshal</p>\r\n\r\n<h2>RE: E30788 / SMARTWAY EXPRESS LLC &amp; Ronald L. SMart</h2>\r\n\r\n<table cellspacing=\"0\" style=\"width:51px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:#dddddd; width:33.4pt\">\r\n			<p>Inbox</p>\r\n			</td>\r\n			<td style=\"background-color:#dddddd; width:5.2pt\">\r\n			<p>x</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img alt=\"https://ssl.gstatic.com/ui/v1/icons/mail/unauth_avatar_red.png\" src=\"https://ssl.gstatic.com/ui/v1/icons/mail/unauth_avatar_red.png\" style=\"height:39pt; width:39pt\" /></p>\r\n\r\n<table cellspacing=\"0\" style=\"width:624px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:393.05pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<table cellspacing=\"0\" style=\"width:1207px\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"width:905.25pt\">\r\n						<h3>NYC Marshal Biegel&nbsp;&lt;nyc@marshalbiegel.com&gt;</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:74.5pt\">\r\n			<p>Thu, Jan 31, 9:33 AM (1 day ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:.15pt\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top; width:.3pt\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"width:467.7pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<table cellspacing=\"0\" style=\"width:1440px\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"width:15.0in\">\r\n						<p>to&nbsp;me,&nbsp;Doug,&nbsp;Elizabeth</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Good morning Carolina,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>∙&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;BMO &ndash; responded account open but contains no funds.</p>\r\n\r\n<p>∙&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Chase &ndash; responded no deposit accounts for the individual, not able to locate business debtor. I reached out to Chase today and confirmed if they searched the debtor by the SSN, EIN and the address (which they are supposed to). The representative said yes, but I got the matter escalated anyways just to be 100% certain they searched by the address provided the first time the levy was served. Do you have an account number for the debtor, in which I call the supervisor with?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Perhaps the debtor processes payments with a 3rd&nbsp;party such as Priority Payment, or AMex?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Thank you,</strong></p>\r\n\r\n<p><strong>Krystale</strong></p>\r\n\r\n<p>Fifth third- No Accounts</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:624px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:395.35pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<table cellspacing=\"0\" style=\"width:1216px\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"width:912.0pt\">\r\n						<h3>NYC Marshal Biegel&nbsp;&lt;nyc@marshalbiegel.com&gt;</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:72.2pt\">\r\n			<p>Tue, Feb 5, 1:10 PM (1 day ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:.15pt\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top; width:.3pt\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"width:467.7pt\">\r\n			<p>&nbsp;</p>\r\n\r\n			<table cellspacing=\"0\" style=\"width:1440px\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"width:15.0in\">\r\n						<p>to&nbsp;Doug,&nbsp;me,&nbsp;Elizabeth</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Good afternoon,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I reached out to Chase for the amended response. The bank was unable to locate an account for the debtor based off the address provided.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Is there any additional asset information for the debtor? The total amount due as of today is $219,126.90.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Would you like me to serve Paymentech LLC?</p>\r\n\r\n<p><a name=\"_gjdgxs\"></a>Liz please send UCC to Paymentech</p>\r\n\r\n<p><a name=\"_d49mn15b7vch\"></a>2/6/2019 BoA no accounts</p>\r\n\r\n<p>2/11/2019 Per PayPal- No Accounts</p>\r\n\r\n<p><strong>ACCOUNT WITH OUTSIDE COUNSEL </strong></p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:989.8pt\">\r\n			<table cellspacing=\"0\" style=\"width:989.25pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>NYC Marshal Biegel&nbsp;&lt;nyc@marshalbiegel.com&gt;</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p>Tue, Jul 23, 10:32 AM</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABAQMAAAAl21bKAAAABlBMVEXAwMAAAAAr16GmAAAAAXRSTlMAQObYZgAAAAxjbVBQSkNtcDA3MTIAAAAHT223pQAAAApJREFUGNNjYAAAAAIAAZhjbNcAAAAASUVORK5CYII=\" style=\"height:.75pt; width:.75pt\" /></p>\r\n\r\n			<p><img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABAQMAAAAl21bKAAAABlBMVEXAwMAAAAAr16GmAAAAAXRSTlMAQObYZgAAAAxjbVBQSkNtcDA3MTIAAAAHT223pQAAAApJREFUGNNjYAAAAAIAAZhjbNcAAAAASUVORK5CYII=\" style=\"height:.75pt; width:.75pt\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:15.0in\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Doug,&nbsp;me,&nbsp;Elizabeth</p>\r\n\r\n						<p><img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABAQMAAAAl21bKAAAABlBMVEXAwMAAAAAr16GmAAAAAXRSTlMAQObYZgAAAAxjbVBQSkNtcDA3MTIAAAAHT223pQAAAApJREFUGNNjYAAAAAIAAZhjbNcAAAAASUVORK5CYII=\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Hello Doug,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Paymentech was served and responded no account found for the business. No deposit account located for the individual.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I tried reaching out to the debtor twice but the number provided is no longer in service.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>IS there any additional contact or asset information for the debtor? In the meantime, I&rsquo;ll send the debtor a letter from our office. Hopefully that&rsquo;ll spark some conversation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Thank you,</strong></p>\r\n\r\n<p><strong>Krystale</strong></p>\r\n\r\n<p>ACCOUNT CLOSED BK DISCHARGED&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 0, NULL, '2020-01-24 22:37:47', '2020-01-24 22:37:47', NULL),
