(140, 3, 148, 1, 'Roc v. Absolute Air Conditioning/Rene Carrasco', '<p>Doug,</p>\r\n\r\n<p>I am attaching the bank account search for Rene Carrasco dba Absoulte Aire and it came back negative for any bank accounts.&nbsp; I reviewed the Experian report and it appears he has a ton of debt.&nbsp; I know he had a Navy Army Community Credit Union account in January of 2018 that Roc Funding dealt with; however, it appears it no longer exists.&nbsp; Therefore, there is no account to garnish so unless you know of any non-exempt assets that exist, we are going to close the file.&nbsp; Let me know, thanks.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-24 23:01:33', '2020-01-24 23:01:33', NULL),
