(146, 0, 150, 1, 'legal_scrub', 'legal_scrub', '<p>NYSCEF:&nbsp; Good</p>\r\n\r\n<p>Banking with Chase- I cannot check this account</p>\r\n\r\n<p>Credit card (Square)&nbsp;</p>\r\n\r\n<p>Pay with your credit card via Square.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Other Cash Advances:</p>\r\n\r\n<ul>\r\n	<li>On Deck</li>\r\n	<li>Crestview Financial</li>\r\n	<li>Merchant Solutions</li>\r\n	<li>Cfg Merchant Solutions LLC</li>\r\n	<li>Mr. Advance LLC</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Jess please send Bank runs to Chase, Huntington Bank, Capital One, BOA, Fifth Third Bank, PNC, US Bank, WF, and TD Bank</p>\r\n\r\n<p>Liz please send UCCs to Amex, PayPal, and Square</p>\r\n\r\n<p>2/7/2019 <strong>on:</strong>&nbsp;**Out-of-State Notarization** Clerk is unable to determine whether or not Affidavit of Confession has been notarized in compliance with statutory requirements. Please provide a Certificate of Conformity. See CPLR &sect;2309(c). Go to the Document List for this case (in &ldquo;My Cases&rdquo;) and select &ldquo;Re-file this document&rdquo; to resubmit your corrected document(s). Please note that if you have filed multiple documents ALL the documents must be resubmitted&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:934.9pt\">\r\n			<table cellspacing=\"0\" style=\"width:934.5pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>Carolina Alcaraz</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p>10:26 AM (4 minutes ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:15.0in\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Daren,&nbsp;doreen,&nbsp;Doug</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>This judgment will not get enter.&nbsp;</p>\r\n\r\n<p>Please see the clerk note below.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Reason:</strong>&nbsp;**Out-of-State Notarization** Clerk is unable to determine whether or not Affidavit of Confession has been notarized in compliance with statutory requirements. Please provide a Certificate of Conformity. See CPLR &sect;2309(c). Go to the Document List for this case (in &ldquo;My Cases&rdquo;) and select &ldquo;Re-file this document&rdquo; to resubmit your corrected document(s). Please note that if you have filed multiple documents ALL the documents must be resubmitted&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We will send this file to outside attorney&nbsp;</p>\r\n\r\n<p>2/21/2019 Corrected COJ received from Doreen- Filed</p>\r\n\r\n<p>Ashely please send bank runs t Chase, Huntington Bank, PNC, Fifth third bank, US Bank, KeyBank, Union Bank,&nbsp; Woodforest, WF and BOA</p>\r\n\r\n<p>Liz please send UCCs to Square, PayPal, Amex</p>\r\n\r\n<p>2/25/2019 Per Square- No Accounts</p>\r\n\r\n<p>3/14/2019 Huntington Bank No accounts</p>\r\n\r\n<p>3/29/2019 US Bank No accounts</p>\r\n\r\n<p>4/24/2019 Case reopen</p>\r\n\r\n<p>Ashley please send bank runs to PNC, Fifth third Bank, US Bank, KeyBank, Citizens Bank, Woodforest, Peoples Bank, Union Bank, Navy Federal Credit Union, BOA, Capital One, Regions Bank and Bb&amp;T</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Liz UCC to PayPal</p>\r\n\r\n<p>5/1/2019 Chase acct# 2685 below exemption no hold</p>\r\n\r\n<p>5/6/2019 Regions No accounts</p>\r\n\r\n<p>5/14/2019 US bank No accounts</p>\r\n\r\n<p>5/14/2019 Citizens Bank No accounts</p>\r\n\r\n<p>5/20/2019 BB&amp;T- No Accounts</p>\r\n\r\n<p>BOA- No Accounts</p>\r\n\r\n<p>KeyBank- No Accounts</p>\r\n\r\n<p>5/28/2019&nbsp; Per Doug</p>\r\n\r\n<p>US&nbsp;Bank says nothing had changed since March</p>\r\n\r\n<p>Navy Federal No Accounts</p>\r\n\r\n<p>6/3/2019 Peoples Bank- No Accounts</p>\r\n\r\n<p><strong>ACCOUNT WITH OUTSIDE COUNSEL</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:943.1pt\">\r\n			<table cellspacing=\"0\" style=\"width:942.75pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>Allison Harrison</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p>Tue, Jan 7, 4:27 PM (8 days ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABAQMAAAAl21bKAAAABlBMVEXAwMAAAAAr16GmAAAAAXRSTlMAQObYZgAAAAxjbVBQSkNtcDA3MTIAAAAHT223pQAAAApJREFUGNNjYAAAAAIAAZhjbNcAAAAASUVORK5CYII=\" style=\"height:.75pt; width:.75pt\" /></p>\r\n\r\n			<p><img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABAQMAAAAl21bKAAAABlBMVEXAwMAAAAAr16GmAAAAAXRSTlMAQObYZgAAAAxjbVBQSkNtcDA3MTIAAAAHT223pQAAAApJREFUGNNjYAAAAAIAAZhjbNcAAAAASUVORK5CYII=\" style=\"height:.75pt; width:.75pt\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:15.0in\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Doug,&nbsp;me</p>\r\n\r\n						<p><img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABAQMAAAAl21bKAAAABlBMVEXAwMAAAAAr16GmAAAAAXRSTlMAQObYZgAAAAxjbVBQSkNtcDA3MTIAAAAHT223pQAAAApJREFUGNNjYAAAAAIAAZhjbNcAAAAASUVORK5CYII=\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>The debtor filed for Bankruptcy in October. We followed the case on&nbsp;<a href=\"http://pacer.gov/\" target=\"_blank\">pacer.gov</a>. We looked to file a claim, but saw the following notation:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Chapter 7 Trustee&#39;s Report of No Distribution: I, Larry J McClatchey, having been appointed trustee of the estate of the above-named debtor(s), report that I have neither received any property nor paid any money on account of this estate; that I have made a diligent inquiry into the financial affairs of the debtor(s) and the location of the property belonging to the estate; and that there is no property available for distribution from the estate over and above that exempted by law. Pursuant to Fed R Bank P 5009, I hereby certify that the estate of the above-named debtor(s) has been fully administered. I request that I be discharged from any further duties as trustee. Key information about this case as reported in schedules filed by the debtor(s) or otherwise found in the case record: This case was pending for 3 months. Assets Abandoned (without deducting any secured claims): $ 137183.40, Assets Exempt: $ 33197.29, Claims Scheduled: $ 2155423.00, Claims Asserted: Not Applicable, Claims scheduled to be discharged without payment (without deducting the value of collateral or debts excepted from discharge): $ 2155423.00 (McClatchey, Larry) (Entered: 12/09/2019)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>There are no assets to satisfy the judgement. Given this, we did not file a proof of claim. The case is still pending and we are still able to file a proof of claim, but according to the trustee it will not be frutifull.&nbsp;</p>\r\n\r\n<p>Sincerely,&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Allison L. Harrison, Esq.</p>\r\n\r\n<p>Allison L. Harrison Law, LLC</p>\r\n\r\n<p>100 E. Broad St, Suite 320</p>\r\n\r\n<p>Columbus, Ohio 43215</p>\r\n\r\n<p>Ph: 614-440-1395&nbsp;</p>\r\n\r\n<p>Fax: 614-308-8133</p>\r\n\r\n<p>&nbsp;</p>', 0, NULL, '2020-01-24 23:09:40', '2020-01-24 23:09:40', NULL),
