(157, 0, 160, 1, 'legal_scrub', 'legal_scrub', '<p>We have a judgment for $24,956.66</p>\r\n\r\n<p>Banking with Pinnacle- Out of jurisdiction</p>\r\n\r\n<p>Other Cash Advance:</p>\r\n\r\n<ul>\r\n	<li>Yellowstone</li>\r\n	<li>Green Capital</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Liz please send Information Subpoenas to Quality Concrete, and American Plastering</p>\r\n\r\n<p>Bank runs to BOA, Fifth Third Bank, Regions Bank, US Bank, Chase and WF</p>\r\n\r\n<p>UCCs to Square, Amex, and PayPal</p>\r\n\r\n<p>2/21/2019 Per Square- No Accounts</p>\r\n\r\n<p>3/1/2019 Wells Fargo No Accounts</p>\r\n\r\n<p>Regions Bank- Account closed</p>\r\n\r\n<p>4/1/2019 Amex No accounts</p>\r\n\r\n<p>7/9/2019 Asked Liz for updates</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:6.5in\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table cellspacing=\"0\" style=\"width:15.0in\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>Per Liz<img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Called both, both stated that they do not owe any money to specialized concrete.</p>\r\n\r\n<h2>Fwd: Roc Funding v. Speialized Concrete Services</h2>\r\n\r\n<table cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:#dddddd\">\r\n			<p>Inbox</p>\r\n			</td>\r\n			<td style=\"background-color:#dddddd\">\r\n			<p>x</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img alt=\"https://ssl.gstatic.com/ui/v1/icons/mail/profile_mask2.png\" src=\"https://ssl.gstatic.com/ui/v1/icons/mail/profile_mask2.png\" style=\"height:24pt; width:24pt\" /></p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:891.8pt\">\r\n			<table cellspacing=\"