ek.</p>\r\n\r\n<p>The key is you have to communicate with me.</p>\r\n\r\n<p>Take this opportunity to get this worked out before we send this matter to our TN collections lawyer at which time a 25% legal fee will be added.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n7/18/2019 Ashley please send Bank runs to US Bank, Regions Bank, Pinnacle Bank (make sure is the same bank from the bank statements), BOA, Fifth Third Bank, Chase, and BB&amp;T</p>\r\n\r\n<p>Lizzy please get an update from PayPal</p>\r\n\r\n<p>7/30/2019 Regions- No Account</p>\r\n\r\n<p>8/5/2019 Pinnacle Bank No accounts</p>\r\n\r\n<p>8/8 BB&amp;T- No Accounts</p>\r\n\r\n<p>US Bank- No Accounts</p>\r\n\r\n<p>Chase- Account closed</p>\r\n\r\n<p>Fifth Third Bank- No Accounts</p>\r\n\r\n<p>1/24/2020&nbsp; Account reopen&nbsp;</p>\r\n\r\n<p>Lizel please send bank runs to Regions Bank, US Bank, BOA, Fifth third Bank, WF, BB&amp;T, Union and BMO Harris&nbsp;</p>\r\n\r\n<p>Ashley please send UCCs to Paypal, Amex and&nbsp;Pinnacle Bank MID:16194560</p>\r\n\r\n<p>Asked Doug to please send this case to TN.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 0, NULL, '2020-01-25 00:00:43', '2020-01-25 00:00:43', NULL),
