(161, 0, 163, 1, 'legal_scrub', 'legal_scrub', '<p>NYSCEF: Good</p>\r\n\r\n<p>Banking with Chase- The merchant currently had 4k on the account</p>\r\n\r\n<p>Processing with Velo Payments MID: 1814075675</p>\r\n\r\n<p>Other Cash Advances:</p>\r\n\r\n<ul>\r\n	<li>Spark Funding</li>\r\n	<li>EIN Cap</li>\r\n	<li>Mantis Funding</li>\r\n	<li>Yellowstone</li>\r\n	<li>Flexibility Capital</li>\r\n	<li>Merchant Source</li>\r\n	<li>Saturn Funding</li>\r\n	<li>Green Capital</li>\r\n</ul>\r\n\r\n<p>Liz please send UCCs to PayPal, Amex, Square and Velo Payments MID: 1814075675</p>\r\n\r\n<p>Information Subpoena to Bold Financial Truckrpath MID: 1454521969, Area Wide Logistics, CHRW, Custom Companies Inc, D &amp; L Transport, LLC, Echo Global Logistics, Global Tranz Enterprises Inc, Lynn Trucking, Inc, Mode Transportation, Sunteck Transport Co., Inc., TQL, XPO Logistics, Lynn Trucking, Inc</p>\r\n\r\n<p>Ashely please send Bank runs to Chase, BOA, Woodforest, US Bank, BMO Harris, Fifth Third Bank, PNC, WF, TD Bank, and Union Bank</p>\r\n\r\n<p>2/25/2019 Per PayPal- Accounts on hold. $0.00</p>\r\n\r\n<p>2/26/2019 Per CH Robinson</p>\r\n\r\n<p>The factoring company has a lien before us. However, the merchant is banking with BMO.</p>\r\n\r\n<p>Per LPL Financial</p>\r\n\r\n<p>From:&nbsp;<strong>Holley Christenbury</strong>&nbsp;&lt;<a href=\"mailto:Holley.Christenbury@lpl.com\" target=\"_blank\">Holley.Christenbury@lpl.com</a>&gt;<br />\r\nDate: Tue, Feb 26, 2019 at 2:34 PM<br />\r\nSubject: ROC Funding v. One Road Express<br />\r\nTo:&nbsp;<a href=\"mailto:eheng@rtrrecoveryllc.com\" target=\"_blank\">eheng@rtrrecoveryllc.com</a>&nbsp;&lt;<a href=\"mailto:eheng@rtrrecoveryllc.com\" target=\"_blank\">eheng@rtrrecoveryllc.com</a>&gt;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>Per our phone conversation, attached is the response from Bold Financial.&nbsp; Our company, LPL Financial is the broker/dealer and custodian of records for Bold Financial and thus responds on their behalf.&nbsp;<