r\n			<table cellspacing=\"0\" style=\"width:15.0in\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Elizabeth,&nbsp;me</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>One Road Express has been a continuous client of Instapay Flexible LLC &nbsp;(and our predecessor in interest Trucker Path ) since 7/27/2017, as such subsequent lenders &nbsp;have no rights to any funds derived from loads hauled by &nbsp;One Road Express.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I&rsquo;m sure RTR noticed this filing when you made your lending decision.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>So if you have sent any demands or notices please retract them.</p>\r\n\r\n<p><img alt=\"https://ssl.gstatic.com/ui/v1/icons/mail/images/cleardot.gif\" src=\"https://ssl.gstatic.com/ui/v1/icons/mail/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n\r\n<p>7/15/*2019 Asked Doreen to please check who has UCC priority</p>\r\n\r\n<p>7/19/2019 PNC- No Accounts</p>\r\n\r\n<p>Per InstaPay</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:946.55pt\">\r\n			<table cellspacing=\"0\" style=\"width:946.5pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>Charisse Castagnoli&nbsp;&lt;charisse.c@getinstapay.com&gt;</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p>Jul 3, 2019, 11:59 AM</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75p