(162, 3, 163, 1, 'Prior/ Senior Liens', '<p><strong>CH Robinson-</strong>The factoring company has a lien before us.</p>\r\n\r\n<p><strong>LPL Financial-</strong></p>\r\n\r\n<p>Per our phone conversation, attached is the response from Bold Financial.&nbsp; Our company, LPL Financial is the broker/dealer and custodian of records for Bold Financial and thus responds on their behalf.&nbsp;</p>\r\n\r\n<p>Thank you for providing additional information on this matter, however, we cannot find any accounts relating to the judgment debtor entities.&nbsp;</p>\r\n\r\n<p>Please let me know if I need to mail the original of this to you.</p>\r\n\r\n<p><strong>Per LevoPayments</strong></p>\r\n\r\n<p>This was helpful and I have now located One Road Express in our platform. As reflected in the statements provided, Velo facilitates these payments at the instruction our client Instapay. Demands for accounts receivable should be brought to InstaPay&rsquo;s attention.</p>\r\n\r\n<p><strong>Per&nbsp; InstaPay&rsquo;s-</strong></p>\r\n\r\n<p>One Road Express has been a continuous client of Instapay Flexible LLC &nbsp;(and our predecessor in interest Trucker Path ) since 7/27/2017, as such subsequent lenders &nbsp;have no rights to any funds derived from loads hauled by &nbsp;One Road Express.</p>\r\n\r\n<p>(Their UCC is from 7/27/2017)&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-27 17:12:14', '2020-01-27 17:12:14', NULL),
(163, 3, 163, 1, '1st and 2nd Attempt updates/ Case reopen', '<p>The merchant was working with corporate turnaround, but he didn&#39;t agree with his balance.&nbsp;</p>\r\n\r\n<p>Our last conversation with the merchant-Her husband had emergency by-pass surgery on August 12th, and they currently have no income and medical bills over $232k.</p>\r\n\r\n<p>No BK&#39;s yet.&nbsp;</p>\r\n\r\n<p>PayPal- Accounts on hold. $0.00- No activity&nbsp;</p>\r\n\r\n<p>Chase- Account closed</p>\r\n\r\n<p>Intuit- Account closed</p>\r\n\r\n<p>US Bank- Account7229 $300 below</p>\r\n\r\n<p>The account was reopened for legal action.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-27 17:19:20', '2020-01-27 17:19:20', NULL),
