(165, 3, 175, 1, 'FILE UPDATE Roc Funding Group LLC vs. Torocco\'s Cooling and Heating Inc', '<p>Dear Mr. Robinson:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We are writing to inform you that the hearing on our Motion for Summary Judgment in the above-referenced case is scheduled for March 23, 2020.&nbsp; We will notify you immediately after the hearing unless something of importance arises sooner.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-27 17:29:38', '2020-01-27 17:29:38', NULL),
