alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:15.0in\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Aaron,&nbsp;Ben,&nbsp;Angela,&nbsp;me</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>I have all. &nbsp;I&rsquo;ll send tomorrow</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:886.5pt\">\r\n			<table cellspacing=\"0\" style=\"width:886.5pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>Doug Robinson</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p>Tue, Apr 9, 7:25 PM (15 hours ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:15.0in\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Angela,&nbsp;Aaron,&nbsp;Ben,&nbsp;me</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>We usually hit all receivables with UCC Lien notices and processors. &nbsp;I&rsquo;ll look.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p>Sent from my iPhone</p>\r\n\r\n<p>4/10/2019 Per Lane Powell <strong>From:</strong>&nbsp;&quot;Stone, Nick&quot; &lt;<a href=\"mailto:StoneN@LanePowell.com\" target=\"_blank\">StoneN@LanePowell.com</a>&gt;<br />\r\n<strong>Date:</strong>&nbsp;April 9, 2019 at 9:19:11 PM EDT<br />\r\n<strong>To:</strong>&nbsp;&quot;<a href=\"mailto:drobinson@rtrrecoveryllc.com\" target=\"_blank\">drobinson@rtrrecoveryllc.com</a>&quot; &lt;<a href=\"mailto:drobinson@rtrrecoveryllc.com\" target=\"_blank\">drobinson@rtrrecoveryllc.com</a>&gt;<br />\r\n<strong>Cc:</strong>&nbsp;&quot;Sanchez, Gabriela&quot; &lt;<a href=\"mailto:SanchezG@LanePowell.com\" target=\"_blank\">SanchezG@LanePowell.com</a>&gt;<br />\r\n<strong>Subject:</strong>&nbsp;<strong>ROC Funding Group, LLC v. Torocco&#39;s Cooling and Heating, Inc. (Barkley Place)</strong></p>\r\n\r\n<p>Dear Mr. Robinson,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Your office sent a subpoena and restraining notice to our client, Barkley Place, dated February 28, 2019.&nbsp; We are reaching out to you on behalf of our client to inform you that our client is no longer conducting business with Torocco&rsquo;s Cooling and Heating.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please let us know if you have any questions regarding Barkley Place for the above-referenced matter.&nbsp; If we do not hear from you, we will assume that this matter is concluded with respect to our client.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sincerely,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nick</p>\r\n\r\n<p>&nbsp;From:&nbsp;<strong>Perry, Stacie (Synchrony)</strong>&nbsp;&lt;<a href=\"mailto:stacie.perry@syf.com\" target=\"_blank\">stacie.perry@syf.com</a>&gt;<br />\r\nDate: Tue, Apr 23, 2019 at 11:17 AM<br />\r\nSubject: RE: [External] Re: Torocco&rsquo;s Cooling and Heating Inc<br />\r\nTo: Elizabeth Heng &lt;<a href=\"mailto:eheng@rtrrecoveryllc.com\" target=\"_blank\">eheng@rtrrecoveryllc.com</a>&gt;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>Hi Elizabeth,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please find letter sent 3/21</p>\r\n\r\n<p>No funds, no activity and we terminated them.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks!</p>\r\n\r\n<p>Stacie</p>\r\n\r\n<p>5/13/2019<br />\r\nDoug</p>\r\n\r\n<p>Client is OK with a 200k settlement at 425 per direct ACH beginning next week, if we can get the papers signed in time.</p>\r\n\r\n<p>Sincerely</p>\r\n\r\n<p>Rich Coviello</p>\r\n\r\n<p>Debt Resolution Specialist</p>\r\n\r\n<p>Corporate Turnaround: 1.(800)411-1113 x4094 F: 1.201.845.8086&nbsp;<a href=\"mailto:rcoviello@corporateturnaround.com\" target=\"_blank\">rcoviello@corporateturnaround.com</a></p>\r\n\r\n<p>Corporate Turnaround | 95 N. State Route 17, Suite 310 | Paramus, NJ 07652</p>\r\n\r\n<p><a href=\"http://www.corporateturnaround.com/\" target=\"_blank\">www.corporateturnaround.com</a></p>\r\n\r\n<h2>Fwd: Torocco Cooling &amp; Heating Inc. / ROC Funding</h2>\r\n\r\n<table cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:#dddddd\">\r\n			<p>Inbox</p>\r\n			</td>\r\n			<td style=\"background-color:#dddddd\">\r\n			<p>x</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img alt=\"https://ssl.gstatic.com/ui/v1/icons/mail/profile_mask2.png\" src=\"https://ssl.gstatic.com/ui/v1/icons/mail/profile_mask2.png\" style=\"height:32px; width:32px\" /></p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:679.3pt\">\r\n			<table cellspacing=\"0\" style=\"width:678.75pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>Doug Robinson</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p>Fri, May 10, 1:57 PM (3 days ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:909.0pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Gil,&nbsp;Daren,&nbsp;Richard, bcc:&nbsp;me</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:1px; width:1px\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Gil, this is on Torocco&#39;s, the offer is $200k at $425/ day.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I have cc&#39;d Rich Coviello at Corporate Turnaround on this e-mail. He has come through with some substantial settlements.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>It&#39;s yours to run with, please keep me advised.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you.&nbsp; Doug</p>\r\n\r\n<p>5/29/20019 BOA- No Accounts</p>\r\n\r\n<p>12/10 <strong>From:</strong>&nbsp;Emily Labart &lt;Elabart@Marcadislaw.com&gt;<br />\r\n<strong>Date:</strong>&nbsp;December 9, 2019 at 9:11:46 AM EST<br />\r\n<strong>To:</strong>&nbsp;&quot;<a href=\"mailto:drobinson@rtrrecoveryllc.com\" target=\"_blank\">drobinson@rtrrecoveryllc.com</a>&quot; &lt;<a href=\"mailto:drobinson@rtrrecoveryllc.com\" target=\"_blank\">drobinson@rtrrecoveryllc.com</a>&gt;<br />\r\n<strong>Subject:</strong>&nbsp;<strong>Roc Funding Group LLC vs Torocco&#39;s Cooling and Heating Inc., Our file No. 98755</strong></p>\r\n\r\n<p>﻿</p>\r\n\r\n<p>Good Morning.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please be advised the debtor has been served with the Summons and Complaint and has filed an answer to the Complaint. We are securing a date and time for a Summary Judgment hearing.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When a date and time has been secured you will receive an email providing you with the date and time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please advance your file 30 days.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you,</p>\r\n\r\n<p>OUTSIDE COUNSEL&nbsp;</p>', 0, NULL, '2020-01-27 17:30:19', '2020-01-27 17:30:19', NULL),
(167, 3, 176, 4, 'Settled $45k/ Pay off letter requested', '<p>Merchant requested a payoff on 1/24/2020.</p>\r\n\r\n<p>Balance still due $19,657.80</p>', NULL, 0, '', '2020-01-27 17:37:53', '2020-01-27 17:37:53', NULL),
(168, 0, 176, 1, 'legal_scrub', 'legal_scrub', '<p>NYSCEF: Good</p>\r\n\r\n<p>Banking with WF. Merchant has a current balance of $7,824.10</p>\r\n\r\n<p>Other Cash Advances:</p>\r\n\r\n<ul>\r\n	<li>Kabbage</li>\r\n	<li>On Deck</li>\r\n	<li>Ocean Loan Services</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Receivables:</p>\r\n\r\n<ul>\r\n	<li>2848 Pleasant Avenue South- &nbsp;<em><strong>2848 Pleasant Ave</strong></em>, Minneapolis, MN 55408- Attention Account Payables &nbsp;</li>\r\n	<li>Sabor Cuencano-419 East lake Kitchen- 419 E Lake St, Minneapolis, MN 554080- Attention Account Payables &nbsp;</li>\r\n	<li>Essex Building- 925 Nicollet Mall, Minneapolis, MN 55402- Attention Accounts Payables</li>\r\n	<li>Antro Bar- 419 East Lake Street- 419 E Lake St,&nbsp;Minneapolis,&nbsp;MN&nbsp;55408- Attention Accounts Payables</li>\r\n	<li>Panera Bread #1305- 2515 White Bear Avenue N, Maplewood, MN 55109- Attention Accounts Payable</li>\r\n	<li>814 Lowry Avenue- 814 Lowry Ave N, Minneapolis, MN 55411- Attention Accounts Payable</li>\r\n	<li>Hiawatha Suites 4140 Dight Ave S Mpls, MN- Hiawatha Suites Senior Living- Attention Accounts payables</li>\r\n	<li>Kilimanjaro Caf&eacute;- 3021 S 5th Ave, Minneapolis, MN 55408- Attention Accounts Payable</li>\r\n	<li>Raising Cnes- Maple Grove Storm Drain- 9875 Maple Grove Pkwy N, Maple Grove, MN 55369- Attention Accounts payable</li>\r\n	<li>Heart Felt DayCare- 2210 E Pine Lodge Rd, Roswell, NM 88201- Attentions Account payables</li>\r\n	<li>Pimiento-928 W 7TH Street. - 928 West Seventh Street, Saint Paul, MN 55102- Attention Account payables</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Liz please send Marshal to WF, US Bank,&nbsp; and BMO Harris</p>\r\n\r\n<p>UCCs to Amex, PayPal, and Square</p>\r\n\r\n<p>Ashely please send Bank of the West, WF, US Bank,&nbsp; BMO Harris, Santander, Chase, BOA, Union Bank, and Capital One</p>\r\n\r\n<p>Information Subpoenas to other receivables</p>\r\n\r\n<p>2/28/2019 Per Square- No Accounts</p>\r\n\r\n<p>3/5/2019 Per BMO- Marshal levy</p>\r\n\r\n<p>No Accounts</p>\r\n\r\n<p>Per the Marshal</p>\r\n\r\n<p>BMO (verbal) - No accounts.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>US Bank (verbal) - No accounts.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Wells Fargo does not provide verbals, answer will forwarded to you upon receipt.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-Ari</p>\r\n\r\n<p>3/7/2019 Amex no accounts</p>\r\n\r\n<p>Sabor Cuencano- Never heard of the merchant, neither the company</p>\r\n\r\n<p>4/1/2019 Merchant is on Payment plan</p>\r\n\r\n<p>Wells Fargo check received, $4,635.94</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>See attached for your records.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-Max</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', 0, NULL, '2020-01-27 17:39:11', '2020-01-27 17:39:11', NULL),
(169, 3, 178, 1, 'DO NOT WORK ON THIS CASE ANYMORE', '<p>Per Dooren,&nbsp;</p>\r\n\r\n<p>Good afternoon:</p>\r\n\r\n<p>I am writing to let you know that we are removing the following accounts:</p>\r\n\r\n<p>Absolute Air</p>\r\n\r\n<p>Nyboard&nbsp;</p>\r\n\r\n<p><strong>All Seasons.</strong></p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-27 17:43:26', '2020-01-27 17:44:55', '2020-01-27 17:44:55'),
(170, 3, 178, 1, '1st Update- J17-3116 Roc Funding v. All Seasons HVAC & Tamaz Ksovreli', '<p>Unfortunately, the sheriff reports that there was zero funds at TD Bank where the debtor had maintained an account.</p>\r\n\r\n<p>We&#39;re unaware of any other assets at this time. We are serving an information subpoena on the debtor. If it leads to any positive response we will pursue those leads. If you develop any additional information about assets please let us know as soon as possible.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-27 17:45:50', '2020-01-27 17:45:50', NULL),
(171, 3, 178, 1, '2nd Update-J17-3116 Roc Funding v. All Seasons HVAC & Tamaz Ksovreli', '<p>We are continuing the supplementary proceedings to discover assets of the defendant Kosvrelli.&nbsp; He has not complied with the Information Subpoena we served and now we are making a Motion to hold him in contempt.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please advance your file ahead for seventy-five (75) days for our advice.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-27 17:46:51', '2020-01-27 17:46:51', NULL),
