ke@bucknell.edu\" target=\"_blank\">lmeinke@bucknell.edu</a>&gt;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>Good morning, Douglas and Liz-</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bucknell&nbsp;University is in receipt of Liz&#39;s email below and the attached Notice.&nbsp; While my understanding is that&nbsp;Bucknell&nbsp;is not subject to the NY state courts with regard to the emailed subpoena or notice, please be advised that the University&#39;s only business relationship with Adaptive is through an annual subscription fee totalling $2,475.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please advise if you require additional information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you.</p>\r\n\r\n<p>4/25/2019 Emailed the attorney about a settlement plan. We need to get this guy into a new settlement</p>\r\n\r\n<p>5/2/2019 Renaissance Technologies LLC No accounts and no funds due merchant was paid in 2017 and 2018 for the software licenses.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5/6/2019 Kennesaw State university No accounts</p>\r\n\r\n<h2>Roc v. Adaptive</h2>\r\n\r\n<table cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:#dddddd\">\r\n			<p>Inbox</p>\r\n			</td>\r\n			<td style=\"background-color:#dddddd\">\r\n			<p>x</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img alt=\"https://ssl.gstatic.com/ui/v1/icons/mail/profile_mask2.png\" src=\"https://ssl.gstatic.com/ui/v1/icons/mail/profile_mask2.png\" style=\"height:24pt; width:24pt\" /></p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:676.95pt\">\r\n			<table cellspacing=\"0\" style=\"width:676.5pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>Doug Robinson</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p>Wed, May 8, 4:26 PM (5 days ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:909.0pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;mike, bcc:&nbsp;me</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Mr. Dal Lago:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you for the $44,000 lump sum offer to resolve this.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The default amount is $132,000 and if fees are included it jumps to $165,000 plus marshal&#39;s fees.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Roc doesn&#39;t typically accept settlement offers below their default amount.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We could structure this with the $44k up front then weekly payments to get this up to an acceptable level.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Failing that, this case is slated to go to our FL law firm on Friday and will not be held here unless solid progress is being made.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Let me know.&nbsp; Thanks,&nbsp; Doug&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:673.8pt\">\r\n			<table cellspacing=\"0\" style=\"width:673.5pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>Doug Robinson</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p>Fri, May 10, 10:41 AM (3 days ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:909.0pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Mike, bcc:&nbsp;me</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Mike,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As I wrote above, the default amount is $132,000.&nbsp; Judgment amount is $165,000.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Doug</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:679.3pt\">\r\n			<table cellspacing=\"0\" style=\"width:678.75pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>Doug Robinson</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p>Fri, May 10, 1:59 PM (3 days ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:909.0pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Mike, bcc:&nbsp;me</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Mike, Roc wants a good faith payment much sooner than 60 days.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Its already been several months since a payment has been received.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Your numbers are good- just get us something immediately and I think they&#39;ll bite.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Doug</p>\r\n\r\n<p>5/13/2019 Northrop Grumman no accounts and no money owed to client</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5/14/2019 Kennesaw State University holding $2,823.40 splitting with other funder.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ACCOUNT WITH OUTSIDE COUNSEL</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>7/12/2019 TD Bank- No Accounts</p>\r\n\r\n<p>BBVA- nO Accounts</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>7/15/2019 Roc v. Adaptive Computing</h2>\r\n\r\n<table cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:#dddddd\">\r\n			<p>Inbox</p>\r\n			</td>\r\n			<td style=\"background-color:#dddddd\">\r\n			<p>x</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img alt=\"https://ssl.gstatic.com/ui/v1/icons/mail/profile_mask2.png\" src=\"https://ssl.gstatic.com/ui/v1/icons/mail/profile_mask2.png\" style=\"height:24pt; width:24pt\" /></p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:938.2pt\">\r\n			<table cellspacing=\"0\" style=\"width:937.5pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>Doug Robinson</h3>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style=\"vertical-align:top\">\r\n			<p>10:19 AM (2 hours ago)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top\">&nbsp;</td>\r\n			<td rowspan=\"2\" style=\"vertical-align:top\">\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n\r\n			<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:15.0in\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;Daren,&nbsp;me,&nbsp;Randy,&nbsp;Josh,&nbsp;Nerissa</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>This case is settled.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We received a $15,000 up front payment today which is to be followed by 17 bi-weekly ACH debits of $5,000 8/2</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>7/15/2019 Northrop Grumman- No Accounts</p>\r\n\r\n<p>&nbsp;</p>', 0, NULL, '2020-01-27 17:55:43', '2020-01-27 17:55:43', NULL),
