m>Christian Romaguera</em></strong></p>\r\n\r\n<p>The Ticktin Law Group</p>\r\n\r\n<p>270&nbsp;SW Natura Avenue&nbsp;| Deerfield Beach, Florida 33441</p>\r\n\r\n<p>Phone:&nbsp;<a href=\"tel:(954)%20570-6757\" target=\"_blank\">(561) 232-2222</a>&nbsp;| Fax:&nbsp;(954) 418-7120</p>\r\n\r\n<p>General Email:&nbsp;<a href=\"mailto:CRomaguera@LegalBrains.com\" target=\"_blank\">CRomaguera@LegalBrains.com</a></p>\r\n\r\n<p>Service Email:&nbsp;<a href=\"mailto:Serv554@LegalBrains.com\" target=\"_blank\">Serv554@LegalBrains.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Good afternoon Christian,&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>My name is Carolina; I&#39;m the Paralegal for Roc Funding Group, LLC the Merchant Cash Advance company which provided Mr. Gonzalez and Mrs. Onahira working Capital.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Would you be able to give me an update on this case? My client has a balance of $64,476.44 plus Marshal fees.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5/6/2019 Citibank No accounts</p>\r\n\r\n<p>From:&nbsp;&lt;<a href=\"mailto:dspeth@cdaemail.com\" target=\"_blank\">dspeth@cdaemail.com</a>&gt;<br />\r\nDate: Fri, May 3, 2019 at 2:10 PM<br />\r\nSubject: RE: SUPERPHARMA CORPORATION<br />\r\nTo: Nerissa Thomas &lt;<a href=\"mailto:nthomas@rtrrecoveryllc.com\" target=\"_blank\">nthomas@rtrrecoveryllc.com</a>&gt;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>Nerissa,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I was speaking with my supervisor about this file.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I am working on the HSC, and the attorney was getting assigned to the files which you all have liens on Walmart. Which Walmart doesn&rsquo;t owe the client anything. But what is happening is the client isn&rsquo;t getting the business from Walmart with the three lien&rsquo;s placed</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If we can come into an agreement between all three to keep her in business and everyone paid.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Do you think we can reach an amicable settlement agreement, that will still keep the business up and going?&nbsp; Rather than incurring more cost for domestication or having her attorney filing suits in FL. She wants last from what the client is telling me, and the bankruptcy attorney she had consulted with is trying to push that.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>And hopefully everyone happy. Roc is the 2nd&nbsp;advance; she fully paid her first and then made a 2nd&nbsp;contract with Roc.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Let&#39;s see what we can work out to keep her in business?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Talk with you soon, thank you!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dawn</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5/21/2019 Hello All,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I have spoken with all of you and we are looking to try and put some numbers together for settlement on each of these advances.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This client has been out of service pretty much since holds placed on WM. She isn&rsquo;t making payments to the program at this time because she has barely any revenue without the WM. Ironically the way things work with WM they don&rsquo;t owe her anything as the Marshal confirmed for Roc Funding already.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>So what I hope we can all do is meet with a smaller payment for the first month or two and then an increase once she starts following with WM again and making some revenue to handle the increases on each one of these advances within reason.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hopefully, we can coordinate whatever one needs and keep this business afloat at the same time to ensure everyone paid.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please let me know what the minimum payments on the first month two preferably and those payments will have to be monthly or bi-weekly possibly.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Looking forward to getting this worked out soon, thank you all for your help and patience. Talk with you soon, have a good day.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dawn</p>\r\n\r\n<table cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:white; width:228.75pt\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white\">\r\n			<table cellspacing=\"0\" style=\"width:307.5pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"background-color:white\">\r\n						<table cellspacing=\"0\">\r\n							<tbody>\r\n								<tr>\r\n									<td style=\"vertical-align:top; width:228.75pt\">\r\n									<p><strong>Dawn Speth</strong><br />\r\n									Corporate Debt Advisors</p>\r\n									</td>\r\n								</tr>\r\n								<tr>\r\n									<td style=\"vertical-align:top\">\r\n									<p><strong>d:</strong>&nbsp;&nbsp;561.349.8929<br />\r\n									<strong>p:</strong>&nbsp;&nbsp;800.691.7211<br />\r\n									<strong>f:&nbsp;&nbsp;&nbsp;</strong>888.535.9446<br />\r\n									<strong>e:</strong>&nbsp;&nbsp;<a href=\"mailto:dspeth@cdaemail.com\" target=\"_blank\">dspeth@cdaemail.com</a></p>\r\n									</td>\r\n								</tr>\r\n								<tr>\r\n									<td style=\"vertical-align:top\">\r\n									<p>3333 S Congress Ave<br />\r\n									Suite 303 Delray Beach, Fl 33445</p>\r\n									</td>\r\n								</tr>\r\n								<tr>\r\n									<td style=\"vertical-align:top\">\r\n									<p><a href=\"http://corporatedebtadvisors.com/\" target=\"_blank\">Corporatedebtadvisors.com</a></p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Asked the marshal for an update</p>\r\n\r\n<table cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:929.6pt\">\r\n			<table cellspacing=\"0\" style=\"width:929.25pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<h3>Office</h3>\r\n						</td>\