//mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<table cellspacing=\"0\" style=\"width:876.0pt\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>to&nbsp;me</p>\r\n\r\n						<p><img alt=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" src=\"https://mail.google.com/mail/u/0/images/cleardot.gif\" style=\"height:.75pt; width:.75pt\" /></p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Hi Carolina,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>From what I can tell we have released the accounts that are referenced on the various iterations of this joint settlement form.&nbsp; But I can confirm that we have received a signed settlement agreement with superpharma as of yesterday.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Since we have no knowledge of the payment plans with other creditors on this agreement I do not see the need to be party of an agreement with other creditors.&nbsp; I&rsquo;m happy to give you copies of the relevant releases if that&rsquo;ll cover your concerns.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table style=\"width:876.0pt\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top\">\r\n			<table>\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"vertical-align:top\">\r\n						<table style=\"width:97.5pt\">\r\n							<tbody>\r\n								<tr>\r\n									<td style=\"vertical-align:top\">\r\n									<p><strong>Zachary&nbsp;Chasin</strong></p>\r\n									</td>\r\n								</tr>\r\n								<tr>\r\n									<td style=\"vertical-align:top\">\r\n									<table>\r\n										<tbody>\r\n											<tr>\r\n												<td style=\"vertical-align:top\">\r\n												<p>MCA&nbsp;Recovery</p>\r\n												</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n									</td>\r\n								</tr>\r\n								<tr>\r\n									<td style