(186, 0, 172, 1, 'legal_scrub', 'legal_scrub', '<p>We have a judgment for $15,909.94</p>\r\n\r\n<p>Banking with BOA $-1,414.65</p>\r\n\r\n<p>Other Cash Advances:</p>\r\n\r\n<ul>\r\n	<li>EIN Cap</li>\r\n	<li>Signature Financial</li>\r\n	<li>Mantis Funding</li>\r\n	<li>For a Financial</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Lizzy UCCs to ADP, Synchrony, Amex, PayPal, and Square</p>\r\n\r\n<p>Ashley Bank runs to BOA, Santander, Chase, Capital One, Applied Bank, Citibank, HSBC, Investors Bank, M&amp;T Bank, PNC, Valley National Bank, WF, Woori American Bank, Bank of Hope, Cathay Bank, and TD Bank</p>\r\n\r\n<p>4/24/2019 ---------- Forwarded message ---------<br />\r\nFrom:&nbsp;<strong>Perry, Stacie (Synchrony)</strong>&nbsp;&lt;<a href=\"mailto:stacie.perry@syf.com\" target=\"_blank\">stacie.perry@syf.com</a>&gt;<br />\r\nDate: Wed, Apr 24, 2019 at 2:52 PM<br />\r\nSubject: No MID - NISSI LOGISTICS LLC - RTR Recovery - Ltr 1G - 4.24.19<br />\r\nTo: Elizabeth Heng &lt;<a href=\"mailto:eheng@rtrrecoveryllc.com\" target=\"_blank\">eheng@rtrrecoveryllc.com</a>&gt;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>Hi Liz,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We have no open accounts for this merchant.&nbsp; Please find letter attached and to follow in mail.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>Stacie</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4/29/2019 Per ADP</p>\r\n\r\n<p>Nissi Logistics is a terminated ADP client.&nbsp; ADP is not in possession of any funds for Nissi Logistics.&nbsp;</p>\r\n\r\n<p>4/29/2019 SQUARE - Forwarded message ---------<br />\r\nFrom:&nbsp;<strong>Emily Ehrlich</strong>&nbsp;&lt;<a href=\"mailto:civilprocess@squareup.com\" target=\"_blank\">civilprocess@squareup.com</a>&gt;<br />\r\nDate: Fri, Apr 26, 2019 at 7:27 PM<br />\r\nSubject: Nissi Logistics LLC - Lien<br />\r\nTo: Elizabeth Heng &lt;<a href=\"mailto:eheng@rtrrecoveryllc.com\" target=\"_blank\">eheng@rtrrecoveryllc.com</a>&gt;</p>\r\n\r\n<p>Hello,</p>\r\n\r\n