(200, 0, 151, 1, 'legal_scrub', 'legal_scrub', '<p><a href=\"https://iapps.courts.state.ny.us/nyscef/DocumentList?docketId=7GVTyUw1XYcOeeLKMqtxoA==&amp;display=all&amp;courtType=Richmond%20County%20Supreme%20Court&amp;resultsPageNum=1\">152110/2018</a> We have a judgment for $398,287.65 filed on August 14, 2018</p>\r\n\r\n<p><a href=\"https://iapps.courts.state.ny.us/nyscef/DocumentList?docketId=frey9maB3X5Vrz5a0py2/w==&amp;display=all&amp;courtType=Westchester%20County%20Supreme%20Court&amp;resultsPageNum=1\">50461/2019</a> Second Judgment for $457,960.37 filed on January 4, 2019. <strong>WE ONLY HAVE TO USE THIS JUDGMENT </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sent an email to Daren regarding the judgments since one of them is completely incorrect.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Good morning,&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We want to start working on this case ASAP, however, since its only<strong>&nbsp;one open advance</strong>.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Why do you have two judgments using the same COJ?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://iapps.courts.state.ny.us/nyscef/DocumentList?docketId=7GVTyUw1XYcOeeLKMqtxoA==&amp;display=all&amp;courtType=Richmond%20County%20Supreme%20Court&amp;resultsPageNum=1\" target=\"_blank\">152110/2018</a>&nbsp;First Judgment for $398,287.65 filed on August 14, 2018</p>\r\n\r\n<p><a href=\"https://iapps.courts.state.ny.us/nyscef/DocumentList?docketId=frey9maB3X5Vrz5a0py2/w==&amp;display=all&amp;courtType=Westchester%20County%20Supreme%20Court&amp;resultsPageNum=1\" target=\"_blank\">50461/2019</a>&nbsp;Second Judgment for $457,960.37 filed on January 4, 2019.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>How can this be even possible? The judgment filed in August 2018, should have a more significant balance than the judgment filed on the beginning of this year.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please, we need some clarification to move forward.&nbsp;</p>\r\n\r\n<p>&