(220, 0, 123, 1, 'legal_scrub', 'legal_scrub', '<p>This deal is a consolidation</p>\r\n\r\n<p>-- we funded&nbsp; &nbsp; $12,848.00</p>\r\n\r\n<p>&nbsp; &nbsp;RTR&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $19,143.52</p>\r\n\r\n<p>amount paid&nbsp; &nbsp; $3,337.81</p>\r\n\r\n<p>Balance due&nbsp; &nbsp; $15805.71</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have any questions, please&nbsp;let me know</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>NYSCEF: Good</p>\r\n\r\n<p>Banking with US Bank</p>\r\n\r\n<p>Processing with TSYS</p>\r\n\r\n<p>Other Cash Advances:</p>\r\n\r\n<ul>\r\n	<li>Pearl Capital</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>EBF Partners</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>West Coast Business</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mantis Funding</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Liz please send UCCs to PayPal, TSYS MID: 543684555851931, Stripe, Amex and Square</p>\r\n\r\n<p>Marshal to US Bank, PayPal, TSYS MID: 543684555851931</p>\r\n\r\n<p>Ashley please send Bank runs to US Bank, BOA, WF, Bank of the West, Chase, Union Bank, Comerica, BB&amp;T, East West Bank, TD Bank, Cathay Bank, Bank of Hope, Citibank, Citizens Bank, First Republic Bank, HSBC, Navy Federal Credit Union , Preferred Bank, and BBVA</p>\r\n\r\n<p>6/24/2019 - Forwarded message ---------<br />\r\nFrom:&nbsp;<strong>Stripe Legal Notices</strong>&nbsp;&lt;<a href=\"mailto:notices@stripe.com\">notices@stripe.com</a>&gt;<br />\r\nDate: Mon, Jun 24, 2019 at 1:00 PM<br />\r\nSubject: Re: Tedebear, LLC DBA Ted&rsquo;s Grooming Emporium &amp; Pet Supply<br />\r\nTo: Elizabeth Heng &lt;<a href=\"mailto:eheng@rtrrecoveryllc.com\">eheng@rtrrecoveryllc.com</a>&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Payouts frozen and the merchant notified. No funds available - account has never processed a payment.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>On Mon, Jun 24, 2019 at 9:23 AM Elizabeth Heng &lt;<a href=\"mailto:eheng@rtrrecoveryllc.com\">eheng@rtrrecoveryllc.com</a>&gt; wrote:</p>\r\n\r\n<p>Hello,<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please see attached UCC Lien Notice pertaining to the above named merchant.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_heading=h.gjdgxs\"></a>7/1/2019 Navy Federal credit Union No accounts</p>\r\n\r\n<p><a name=\"_heading=h.97l0w215bvqs\"></a>7/2/19: DR Mr. Hudson:</p>\r\n\r\n<p><a name=\"_heading=h.55eaqu8scw7m\"></a></p>\r\n\r\n<p><a name=\"_heading=h.r2dzy9wq3y8f\"></a>I am the lawyer for Roc Funding, the merchant cash advance company that gave you money on March 30, 2019.</p>\r\n\r\n<p><a name=\"_heading=h.e55gb9cx6f9n\"></a></p>\r\n\r\n<p><a name=\"_heading=h.5yoknewmkarq\"></a>This will be your final chance to get into a repayment plan on this debt before we send the case to our San Diego lawyer for suit.&nbsp; Your judgment balance is $20,001.62 and I can get you into a weekly payment plan but you need to contact me.</p>\r\n\r\n<p><a name=\"_heading=h.nqkh6a3btets\"></a></p>\r\n\r\n<p><a name=\"_heading=h.mm1qpy8ruemr\"></a>My information is below.</p>\r\n\r\n<p><a name=\"_heading=h.goxmd99g2711\"></a></p>\r\n\r\n<p><a name=\"_heading=h.g25n87oxoihf\"></a>Doug Robinson</p>\r\n\r\n<p><a name=\"_heading=h.r1b34qnfd5t\"></a></p>\r\n\r\n<p><a name=\"_heading=h.235dg1zhjk69\"></a>&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>7/8/2019 Per Max</p>\r\n\r\n<p>TSYS- Account on hold</p>\r\n\r\n<p>the UCC lien notice for the&nbsp;TedBear LLC&nbsp;(the &ldquo;Merchant&rdquo;) matter and after a due and diligent review of its records, TSYS Merchant Solutions, LLC, as successor in interest of TSYS Business Solutions, LLC, fka TransFirst, LLC (&ldquo;TMS&rdquo;), does have a merchant card processing agreement with the Merchant.&nbsp; Please be aware that TMS is reviewing any and all rights under the Merchant Agreement with regards to this matter and other matters of concern which I am not at liberty to discuss due to confidentiality obligations.&nbsp; Pursuant to the terms of its Merchant Agreement, TMS has determined to invoke its contractual right to place a 100% hold on any&nbsp;<strong>provisional credits</strong>&nbsp;that may result from any sales transactions submitted for processing by the Merchant.&nbsp;&nbsp; As you may already be aware, the merchant has&nbsp;<strong>only a contingent interest</strong>&nbsp;in any settlement proceeds that result from sales transactions it submits for processing with TMS as these settlement proceeds are&nbsp;<strong>provisional</strong>&nbsp;and subject to being overturned, discontinued and revoked by various rules and regulations, including Card Network Operating Rules and other rules, laws and regulations that afford a consumer-cardholder various protections and rights to dispute or reject a sales transaction.&nbsp;&nbsp; The consumer-cardholder has rights to dispute a transaction&nbsp;<strong>for no less than 180 days</strong>&nbsp;from the transaction date,&nbsp;<strong>but this timing could be longer</strong>&nbsp;depending on when the goods or services were rendered, what type of card was used, whether the merchant offered a guaranty, return policy, future date of delivery or service, etc.&nbsp; Therefore, TMS is required to let sufficient time pass to determine whether or not the risk of a consumer-cardholder dispute or other risk concerns with the processing activity on an account is minimized or diminished before it can make any determination as to whether any captured funds, if any, can be released to the proper and rightful party.&nbsp; With this said, we would appreciate&nbsp; your advance cooperation by limiting your follow-up requests as we are unlikely to be able to provide any information to you until sufficient time has passed to be able to determine the viability of the merchant&rsquo;s interest in those provisional credits that may be held.&nbsp; This process is the same for any merchant your client(s) may have a UCC claim in which it provides notice to TMS.&nbsp;<br />\r\n&nbsp;<br />\r\nWith this said, for this Merchant, a hold is in place, but TMS has not been able to capture any funds as of the date of this email.&nbsp; At this point, TMS is not certain whether there will be any transactions that are processed going forward that will result in TMS ability to capture any funds or, if any funds are captured, that the merchant will have a vested interest in these funds in the near future.&nbsp; Please calendar your follow-up for after 180 days from the date of this email.&nbsp; Please follow this process for or expect delays in our ability to respond to your request.&nbsp; Again, thank you for your anticipated cooperation.<br />\r\n&nbsp;<br />\r\nTMS reserves any and all rights, interest and title provided for by the terms of its Merchant Agreement with the Merchant and as allowed pursuant to any and all applicable law, rule or regulations.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Per Stripe-</p>\r\n\r\n<p>Payouts frozen and the merchant notified. No funds available - account has never processed a payment.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>7/12/2018 US Bank-See prior response which we don&rsquo;t have.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Merchant is on BK</p>\r\n\r\n<p>Union Bank- No Accounts</p>\r\n\r\n<p>Chase- Account#8680 $1,184.22 on hold &ndash; released due to BK</p>\r\n\r\n<p>Account#9137 and 5955 below state</p>\r\n\r\n<p>US Bank- Accounts closed</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>7/15/2019 Comerica- No Accounts</p>\r\n\r\n<p>BOA- NO Accounts</p>\r\n\r\n<p>Citizens Bank- No Accounts</p>\r\n\r\n<p>7/22/2019 Bank of the West No accounts</p>\r\n\r\n<p>Cathay Bank- No Accounts</p>\r\n\r\n<p>WF- No Accounts</p>\r\n\r\n<p>9/16 td Bank- No Accounts</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>CASE CLOSED- BK</p>', 0, NULL, '2020-01-27 22:28:33', '2020-01-27 22:28:33', NULL),
