(235, 5, 104, 1, 'Manatee School Board decision to revoke Lincoln charter upheld', '<p>Called&nbsp; 941-6840 business line spoke with personnel and stated I should call 941-708-8770 called number&nbsp;spoke with Alexis in&nbsp;&nbsp;legal personnal she stated I must speak with a Christine Dawson but she did not have aa direct number for me alos stated the board took over ithe end of July. Merchant commited fraud and bribery link below.</p>\r\n\r\n<p>https://www.heraldtribune.com/news/20190724/manatee-school-board-ends-lincoln-academys-charter</p>\r\n\r\n<p>An administrative law judge issued a ruling Friday afternoon upholding the Manatee County School Board&rsquo;s July 23 decision to terminate the charter of Lincoln Memorial Academy, a charter school in Palmetto that&nbsp;<a href=\"https://www.heraldtribune.com/news/20170918/how-one-manatee-school-switched-from-public-to-charter\">began with great hope</a>&nbsp;but quickly spiraled into corruption and controversy.</p>\r\n\r\n<p>Administrative Law Judge Robert Cohen concluded that Principal Eddie Hundley offered essentially no rebuttal to evidence that he endangered the very community he claimed to champion in his quest to get rich.</p>\r\n\r\n<p>&ldquo;While Mr. Hundley&rsquo;s motives in helping found LMA may have started as pure, they quickly became about the riches he could accumulate at the expense of the education, health, safety, and welfare of LMA&rsquo;s students and their families, as well as the staff, who bought into the college preparatory program he promised to provide them,&rdquo; Cohen wrote.</p>\r\n\r\n<p>On July 23, after a year in which Hundley&rsquo;s educator&rsquo;s certificate was&nbsp;<a href=\"https://www.heraldtribune.com/news/20190717/charter-school-founder-has-to-go-state-officials-say\">revoked by the state</a>&nbsp;and&nbsp;<a href=\"https://www.heraldtribune.com/news/20190617/manatees-lincoln-memorial-cant-pay-its-bills\">the school couldn&rsquo;t pay its bills</a>, the Manatee School Board voted to terminate the charter school contract.</p>', NULL, 0, '', '2020-01-28 18:41:14', '2020-01-28 18:41:14', NULL),
