(244, 3, 97, 1, 'ROC Funding Group, LLC v. Pikanhas Restaurant Group, LLC, et al.', '<p><strong>Per the outside attorney-</strong>Hi Doug, this guy&nbsp;has&nbsp;convinced his client she&nbsp;has&nbsp;a leg to stand on.&nbsp; He is offering zero.&nbsp; I spent over an hour on the phone with him this am, and discussed different settlement options.&nbsp; He is banking on recovery of his attorneys fees if he is successful. I will forward you my response.&nbsp;</p>\r\n\r\n<p><strong>Merchants Attorney-</strong></p>\r\n\r\n<p>Angela,</p>\r\n\r\n<p>I met with my client this evening. Our settlement offer is that my clients pay nothing to your client in return for a mutual release of claims. Your client will have to release all liens, claims, UCC filings and somehow undo the confession of the judgment entered in New York.</p>\r\n\r\n<p>Let me know if you want to speak by telephone tomorrow.</p>\r\n\r\n<p>David</p>\r\n\r\n<p><strong>Per our attorney on January 23.&nbsp;</strong></p>\r\n\r\n<p>The case was dismissed in California to avoid a countersuit.&nbsp; However, you have a valid judgment for collection in New York and can be enforcing judgment locally.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-28 20:24:14', '2020-01-28 20:24:14', NULL),
