(267, 0, 75, 1, 'legal_scrub', 'legal_scrub', '<p>NYSCEF: Good</p>\r\n\r\n<p>Banking with Chase and BOA</p>\r\n\r\n<p>BOA $-1,565.00</p>\r\n\r\n<p>Chase $-375.67</p>\r\n\r\n<p>Processing with BAMS mid: 372392165885</p>\r\n\r\n<p>Other Cash Advances:</p>\r\n\r\n<ul>\r\n	<li>Broadway</li>\r\n	<li>Psn*Geneva Capit</li>\r\n	<li>Forwardline Fina</li>\r\n	<li>We Fund Capital</li>\r\n	<li>AscentiumCapital</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n\r\n<p>Receivables:</p>\r\n\r\n<ul>\r\n	<li>Aia Corporation MID: 1043429004</li>\r\n	<li>DoorDash, Inc. MID: 1800948598</li>\r\n	<li>GEIGER GROUP MID:9252061003</li>\r\n</ul>\r\n\r\n<p>Ashley please send UCCs to Amex, BAMS mid: 372392165885 and other receivables</p>\r\n\r\n<table border=\"1\" cellspacing=\"0\" style=\"width:0in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"border-color:black; height:15.0pt; vertical-align:bottom\">\r\n			<p>Amount Outstanding:</p>\r\n			</td>\r\n			<td style=\"background-color:yellow; border-color:black; height:15.0pt\">\r\n			<p>$ 33,471.80</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please add SSN in all the UCC&rsquo;s</p>\r\n\r\n<p>11/7/19 Doordash- No Accounts</p>\r\n\r\n<p>12/6/2019 Amex no accounts processing with FD</p>\r\n\r\n<p>Ashley please send UCC to FD</p>\r\n\r\n<p>1/2/2020 Doordash <strong>From:</strong>&nbsp;Ashley Bristol [<a href=\"mailto:abristol@rtrrecoveryllc.com\" target=\"_blank\">abristol@rtrrecoveryllc.com</a>]<br />\r\n<strong>Sent:</strong>&nbsp;12/20/2019 11:25 AM<br />\r\n<strong>To:</strong>&nbsp;<a href=\"mailto:mxliensandholds@doordash.com\" target=\"_blank\">mxliensandholds@doordash.com</a><br />\r\n<strong>Subject:</strong>&nbsp;ONE WORLD IMPRINT et al.<br />\r\n&nbsp;</p>\r\n\r\n<p>Good afternoon,<br />\r\n<br />\r\nA UCC Lien was sent to your company regarding the above named merchant. We haven&#39;t&nbsp;received&nbsp;an update. Can you please provide me with one? Please see&nbsp;attached original UCC Lien.&nbsp;&nbsp;&nbsp;</p>\