(268, 3, 74, 1, 'DO NOT WORK ON THIS CASE ANYMORE', '<h2>EAGLE&nbsp;DRIVE&nbsp;INN</h2>\r\n\r\n<table cellpadding=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Good morning:</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>I wanted to inform you that we will be removing this account from your collection process. We have a collection person that handles all our asset deals. Can you please let me know what has been done on this account.</p>\r\n\r\n<p>Thank you,</p>', NULL, 0, '', '2020-01-28 23:10:27', '2020-01-28 23:10:27', NULL),
