(316, 0, 272, 1, 'legal_scrub', 'legal_scrub', '<p>Per Doreen&nbsp;</p>\r\n\r\n<p>Good afternoon:</p>\r\n\r\n<p>We just spoke to this merchant she was on modified payments for the last 3 months and just told us she is stopping our payments. This is New York COJ and it must be filed today. She has claimed bankruptcy&nbsp;personally I don&#39;t see a bankruptcy on the business.&nbsp;</p>\r\n\r\n<p>Please call Maria with any questions cell number 727-946-7382 office 718-355-8944.&nbsp;</p>\r\n\r\n<p>NYSCEF: Good</p>\r\n\r\n<p>Pacer:&nbsp;<strong>Bankruptcy Petition #: 1-20-40510-ess- Personal BK Chapter 13</strong></p>\r\n\r\n<p>Banking with Chase. Merchant has $68,197.35</p>\r\n\r\n<p>#805 $-2,901.65</p>\r\n\r\n<p>Processing with Square MID:9424300002</p>\r\n\r\n<p>Merchant has a PayPal account&nbsp;</p>\r\n\r\n<p>Might be Paymentech MID:203050521</p>\r\n\r\n<p>Other Cash Advances:</p>\r\n\r\n<ul>\r\n	<li>Kabbage</li>\r\n	<li>Forwardfinancing</li>\r\n	<li>Retail Capital</li>\r\n	<li>Kalamata</li>\r\n	<li>Swiftfinancial</li>\r\n	<li>Green Capital</li>\r\n	<li>On Deck Capital</li>\r\n	<li>Smartcap</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n\r\n<p>Receivables:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>City of New York MID:7136400434</li>\r\n	<li>Eladia&#39;s Kids PA</li>\r\n	<li>ARMADA BUILDING SERVICES</li>\r\n	<li>BAND SPACES</li>\r\n	<li>BROOKLYN QUEENS LAND TRUST</li>\r\n	<li>DATADEUCE, INC</li>\r\n	<li>EUNICE OSBOURNE</li>\r\n	<li>First Class Commercial Cleaning Services,</li>\r\n	<li>GAZELLE INTERIORS</li>\r\n	<li>GLOCAL ASCENT, LLC</li>\r\n	<li>GUILLERMO GOODE</li>\r\n	<li>JEFFREY PEYSER- Unable to identify</li>\r\n	<li>LATOYA JACKSON- Unable to Identify</li>\r\n	<li>LESLIE WEEKES BILLY- Unable to Identify</li>\r\n	<li>NATHANIEL GRIFFITH- Unable to Identify</li>\r\n	<li>NYC HOUSING PRESERVATION AND DEVELOPMENT</li>\r\n	<li>QUEENS SEVER TRANSPORTATION, INC</li>\r\n	<li>ROSE MARTIN- Unable to Identify</li>\r\n	<li>SHARON SINASWEE- Unable to Identify&nbsp;</li>\r\n	<li>