(319, 3, 272, 1, '1st Attempt for legal action', '<p>UCC&#39;s/ Marshals and bank runs will be served once we get the judgment.&nbsp;</p>\r\n\r\n<p>We are also adding the following note&nbsp;to our documents.</p>\r\n\r\n<p><strong>The individual debtor, Carolann Mccrae filed for Ch. 13&nbsp;Bankruptcy protection. We respectfully request that the bank ONLY holds accounts against the merchant debtor,&nbsp;C.A. MCCRAE, CPA, LLC.</strong></p>', NULL, 0, '', '2020-01-29 23:37:57', '2020-01-29 23:37:57', NULL),
