(323, 3, 124, 4, 'Funds capture/ Payment Plan', '<p>Merchant is signing a direction letter for the full amount capture in the account. $4,811.15.</p>\r\n\r\n<p>Merchant is on a payment plan $750.00 weekly&nbsp;</p>', NULL, 0, '', '2020-01-30 18:11:02', '2020-01-30 18:11:02', NULL),
(324, 3, 142, 1, 'Account reopen for collections', '<p>Merchant claims that business is slow. We sent UCC&#39;s and Bank runs to make sure we lock his accounts before the super bowl.&nbsp;</p>', NULL, 0, '', '2020-01-30 20:13:52', '2020-01-30 20:13:52', NULL),
(325, 3, 261, 1, 'Update from the Outside counsel', '<p>Debtor corporation, while still active with the State of Florida, appears to be out of business. We have spoken with the guarantor who confirmed that the business had closed and when we made a demand under the guaranty, he told us that we would be hearing from his lawyer. Our writing demands has been ignored to date. To domesticate the Judgment we will need a $650.00 court cost deposit.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Doug sent the letter to Daren the same day to pay the costs.&nbsp;</p>', NULL, 0, '', '2020-01-30 21:33:54', '2020-01-30 21:33:54', NULL),
(326, 3, 124, 1, 'Carpe Diem of Southlake', '<p>&nbsp;Carpe Diem of Southlake- Cut all ties due to issues</p>', NULL, 0, '', '2020-01-30 21:42:37', '2020-01-30 21:42:37', NULL);
