(327, 3, 95, 1, 'Update from the Outside counsel 1/27/2020', '<p>Good Morning Doug,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The defendants have failed to respond to our post-judgment discovery. We are proceeding with a motion to compel for their failure to do so. Please advance your file sixty (60) days.</p>', NULL, 0, '', '2020-01-30 21:43:45', '2020-01-30 21:43:45', NULL),
(328, 3, 104, 1, 'Paymentech update', '<p>We have not captured any funds to date. The account remains on hold.</p>', NULL, 0, '', '2020-01-30 22:49:00', '2020-01-30 22:49:00', NULL),
(329, 3, 167, 1, 'UCC Confirmation requested', '<p>We never got the UCC Confirmation. It was requested twice.&nbsp;</p>', NULL, 0, '', '2020-01-30 23:24:44', '2020-01-30 23:24:44', NULL),
(330, 3, 117, 1, 'Update from the Outside counsel', '<p>The 65k- It was a final settlement as to Amazon for the writ of garnishment issues, but not the underlying judgment.</p>\r\n\r\n<p>It looks as thought supplemental proceedings pleadings are done with a hearing scheduled for 2/21/20.&nbsp; But not served yet.</p>\r\n\r\n<p>We will see if we can get some traction on a settlement for this one, but we have not been able to make contact with the debtor to get those discussions started.&nbsp; We are awaiting the second supplemental proceeding order to send for service on Poythress personally, and hopefully that will elicit a call to discuss settlement terms.&nbsp; I will let you know when we have made contact with the debtor.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', '2020-01-30 23:27:29', '2020-01-30 23:27:29', NULL),
(331, 3, 47, 1, 'Update from the Outside counsel', '<p>Suit is prepared and ready for review and signature by an attorney.</p>', NULL, 0, '', '2020-01-31 16:34:46', '2020-01-31 16:34:55', '2020-01-31 16:34:55'),
